namespace Metreos.Interfaces.PackageDefinitions
{
    using System;
    
    public class ApplicationControl
    {
        public class Globals
        {
            public const string NAMESPACE = "Metreos.ApplicationControl";
            public const string PACKAGE_NAME = "Metreos.ApplicationControl";
            public const string PACKAGE_DESCRIPTION = 
		    @"This is defined in the appcontrol gen tool";
       }
        public class Actions
        {
            public class Assign
            {
                public const string NAME = "Assign";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Assign";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>Assign</code> is used to assign a value to a variable. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
               <code>Assign</code> allows one to specify a value in the 
	       <code>Value</code>, <code>Value2</code>, <code>Value3</code>, and <code>Value4</code> action parameters; 
		a value specified in any one of these action parameters will be assigned to the variable in the respective 
		<code>ResultData</code>, <code>ResultData2</code>, <code>ResultData3</code>, <code>ResultData4</code> result data parameters.
            </para>
	    <para>
	    	The <code>Assign</code> action is an effective means to transfer the value of a local variable to a global variable.  This can be done by specifying the local variable as a <code>Value</code> action parameter, and the global variable as the corresponding <code>ResultData</code>.  For reference, another way a local-to-global assignment can be acheived is via the <link linkend=""ApiGlossary.CustomCode""><code>CustomCode</code></link> action.
    	    </para>
	    <para>
               	A specified value in one of the <code>Value</code> action parameters is passed directly to the type variable in the corresponding <code>ResultData</code>. The native type will invoke the best-fit <code>Parse(System.Type)</code> overload in order to complete the assignment of the value.  See <link linkend=""ApiGlossary.NativeType"">native types</link> for more information.
    	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
                The built-in types which map to .NET types (<code>System.String</code>, <code>System.Int32</code>, <code>System.DateTime</code>, etc) will attempt to parse and convert a <code>System.String</code> input assigned to it, using the .NET type's <code>Parse(System.String)</code>.  For instance, if one specifies a literal <code>5</code> as <code>Value</code>, the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> can successfully assign this value to a <link linkend=""Metreos.Types.Int""><code>Int</code></link> native type variable in <code>ResultData</code> because the .NET integer type supports using <code>Parse(System.String)</code> to convert a <code>System.String</code> to a <code>System.Int32</code>.
            </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "Assign";
                public class Params
                {
                    public class Value
                    {
                        public const string NAME = "Value";
                        public const string DISPLAY = "Value";
                        public const string DESCRIPTION = "The value specified for this action parameter will be assigned to <code>ResultData</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Value2
                    {
                        public const string NAME = "Value2";
                        public const string DISPLAY = "Value2";
                        public const string DESCRIPTION = "The value specified for this action parameter will be assigned to <code>ResultData2</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Value3
                    {
                        public const string NAME = "Value3";
                        public const string DISPLAY = "Value3";
                        public const string DESCRIPTION = "The value specified for this action parameter will be assigned to <code>ResultData3</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Value4
                    {
                        public const string NAME = "Value4";
                        public const string DISPLAY = "Value4";
                        public const string DESCRIPTION = "The value specified for this action parameter will be assigned to <code>ResultData4</code>.";
                        public const string DEFAULT = null;
                    }
                }
                public class Results
                {
                    public class ResultData
                    {
                        public const string NAME = "ResultData";
                        public const string DISPLAY = "ResultData";
                        public const string DESCRIPTION = "The variable to hold the value specified in <code>Value</code>.";
                    }
                    public class ResultData2
                    {
                        public const string NAME = "ResultData2";
                        public const string DISPLAY = "ResultData2";
                        public const string DESCRIPTION = "The variable to hold the value specified in <code>Value2</code>.";
                    }
                    public class ResultData3
                    {
                        public const string NAME = "ResultData3";
                        public const string DISPLAY = "ResultData3";
                        public const string DESCRIPTION = "The variable to hold the value specified in <code>Value3</code>.";
                    }
                    public class ResultData4
                    {
                        public const string NAME = "ResultData4";
                        public const string DISPLAY = "ResultData4";
                        public const string DESCRIPTION = "The variable to hold the value specified in <code>Value4</code>.";
                    }
                }
            }
            public class Sleep
            {
                public const string NAME = "Sleep";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Sleep";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>Sleep</code> causes the script to pause execution for the specified number of milliseconds.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
                The <code>Sleep</code> action can be used whenever a short pause is needed during the execution of a function in a script instance.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
              	<code>Sleep</code> causes the script to pause while executing a function, which means other events rising up to the application for processing are being <link linkend=""ApiGlossary.ScriptEventQueue"">queued</link>.  Using <code>Sleep</code> for a long amount of time runs counter to the best practice of spending as little amount of time in a function, due to the fact only one event can be processed at a time.  If a long delay is needed, then consider instead using <link linkend=""Metreos.Providers.TimerFacility.AddTriggerTimer""><code>AddTriggerTimer</code></link> or <link linkend=""Metreos.Providers.TimerFacility.AddNonTriggerTimer""><code>AddNonTriggerTimer</code></link>.
            </para>
	    <para>
	    	<code>Sleep</code> does not use a thread in the Application Runtime threadpool while sleeping.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "Sleep";
                public class Params
                {
                    public class SleepTime
                    {
                        public const string NAME = "SleepTime";
                        public const string DISPLAY = "SleepTime";
                        public const string DESCRIPTION = "The amount of time to sleep (in milliseconds).";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class ChangeLocale
            {
                public const string NAME = "ChangeLocale";
                public const string FULLNAME = Globals.NAMESPACE + "." + "ChangeLocale";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                Changes the current locale of the script instance.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
                 All script instances operate within the context of a locale, as specified in mceadmin for the executing <link linkend=""ApiGlossary.ApplicationPartition""><code>application partition</code></link> of the application. <code>ChangeLocale</code> allows a developer to programmatically change this starting locale after the script instance has begun executing.
            </para>
	    <para>
	    	By changing the locale of the script and setting <code>ResetStrings</code> to <code>true</code>, global variables initialized by localizable strings defined in the locale table will update their values to reflect the string values corresponding to the new locale.  Also, if using the <code>Prompt</code> fields in <link linkend=""Metreos.MediaControl.Play""><code>Play</code></link> or <link linkend=""Metreos.MediaControl.VoiceRecognition""><code>VoiceRecognition</code></link> to specify audio files, the audio file that correlates to the new locale will be played instead after the change.  If there is no value specified in the Localization Editor in the Application Designer for a particular locale of a string, then the global variable that initializes from that localized string will have an empty string value after the <code>ChangeLocale</code> action completes (and if <code>ResetStrings</code> is set to <code>true</code>).  If an audio file does not exist for the current locale, the Play command will play nothing and will complete immediately.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	If global variables are initialized with strings from the locale table, one must set <code>ResetStrings</code> to <code>true</code> in order to have those global variables update their values when the <code>ChangeLocale</code> action is used.
	    </para>
	    <para>
	    	The <link linkend=""ApiGlossary.SessionData""><code>sessionData</code></link> object has a <ulink url=""http://msdn2.microsoft.com/en-us/library/system.globalization.cultureinfo.aspx""><code>System.Globalization.CultureInfo</code></ulink> <code>Culture</code> property.  It represents the current locale of the script, and is updated accordingly by <code>ChangeLocale</code>.
	    </para>
            <para>
