                public const string DISPLAY = "ChangeLocale";
                public class Params
                {
                    public class Locale
                    {
                        public const string NAME = "Locale";
                        public const string DISPLAY = "Locale";
                        public const string DESCRIPTION = 
@"The region-specific RFC-1766 locale you wish to change to.  
This value must be a valid argument for the .NET <code>CultureInfo</code> constructor.  
Refer to the table in the description above for possible values.  
You must have at least one or more localizable strings or one ore more audio files defined for the new locale in order for the action to succeed.";
                        public const string DEFAULT = null;
                    }
                    public class ResetStrings
                    {
                        public const string NAME = "ResetStrings";
                        public const string DISPLAY = "ResetStrings";
                        public const string DESCRIPTION = 
@"If <code>true</code>, any global variable which was initialized by a localizable string will be reinitialized to the value appropriate for the new locale.  
If you have set such an locale-initialized global variable to a new value since the script started, it will be overriden by the localalizable string value for the new locale.";
                        public const string DEFAULT = "False";
                    }
                }
            }
            public class ConstructionComplete
            {
                public const string NAME = "ConstructionComplete";
                public const string FULLNAME = Globals.NAMESPACE + "." + "ConstructionComplete";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>ConstructionComplete</code> informs the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> that the application (and all the scripts defined within it) is now ready for execution after being loaded.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
                <code>ConstructionComplete</code> can only be used in the script that is triggered by the <link linkend=""Metreos.ApplicationControl.StaticConstruction""><code>StaticConstruction</code></link> event.  By using this action, one is indicating to the <code>Application Runtime Environment</code> that the application should be enabled because pre-execution steps have been completed.  After the application is first loaded and before <code>ConstructionComplete</code> is invoked in the <code>StaticConstruction</code> script, the other scripts defined in the application will remain disabled. All events routed to these scripts will be <link linkend=""ApiGlossary.NoHandler"">unhandled</link>.  Non-triggering events and asynchronous events routed to the <code>StaticConstruction</code> script will still be processed as usual.
            </para>
	    <para>
	    	<code>ConstructionComplete</code> should be invoked in the <code>StaticConstruction</code> script once all the logic required for application operation is complete.
	    </para>
	    <para>
	    	There is no need to use <code>ConstructionComplete</code> if the <code>StaticConstruction</code> script is not defined for the application. In such an application, all scripts are enabled and ready for execution as soon as the <code>Application Runtime Environment</code> loads the application.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
              	None.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "ConstructionComplete";
                public class Params
                {
                    public class Success
                    {
                        public const string NAME = "Success";
                        public const string DISPLAY = "Success";
                        public const string DESCRIPTION = 
@"Indicates whether the <code>StaticConstruction</code> script finished all construction tasks successfully. 
If <code>true</code>, the rest of the scripts defined in the application will be enabled.  
If <code>false</code>, then the rest of the scripts will remain disabled for the <link linkend=""ApiGlossary.ApplicationLifetime"">life</link> of the application.";
                        public const string DEFAULT = "False";
                    }
                }
            }
            public class EndScript
            {
                public const string NAME = "EndScript";
                public const string FULLNAME = Globals.NAMESPACE + "." + "EndScript";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>EndScript</code> informs the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> to destroy the script.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
              	<code>EndScript</code> unloads the resources associated with the script, such as global variables.  Every script should always come to an end with either <code>EndScript</code> or  <link linkend=""Metreos.ApplicationControl.Forward""><code>Forward</code></link>; otherwise, script instances will continue to build up, which consumes memory resources on the <link linkend=""ApiGlossary.CUAS""><code>application server</code></link>.
            </para>
	    <para>
	    	Ensuring that all script instances come to a conclusion is important with regards to licensing; the <link linkend=""ApiGlossary.CUAS""><code>application server</code></link> licensing scheme is based on the amount of concurrently running scripts.  Ending a script instance releases one script instance license unit.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	When a script ends due to <code>EndScript</code>, the <link linkend=""Metreos.ApplicationControl.InstanceDestruction""><code>InstanceDestruction</code></link> event is fired with an <link linkend=""Metreos.ApplicationControl.InstanceDestruction.EventParams.ErrorCode""><code>ErrorCode</code></link> value of <code>0</code>.
	    </para>
 	    <para>
	    	After a script is ended, any non-triggering (unsolicited or asynchronous) events routed to this script instance will result in a <link linkend=""ApiGlossary.NoHandler""><code>no handler</code></link>.  The provider that orginated the event is informed of the no handler and can take the appropriate action for the protocol or API it consumes.
	    </para>
 	    <para>
	    	If <link linkend=""ApiGlossary.Sandboxing"">sandboxing</link> is turned on, then any calls or connections that were created by the script instance are automatically destroyed.
	    </para>
	    <para>
	    	<code>EndScript</code> is an example of a <link linkend=""ApiGlossary.Final""><code>final</code></link> action, which means no other actions can occur after this action in the function from which it was invoked.  In the special case of <code>EndScript</code> or <code>Forward</code>, the only actions in the current script instance that can occur after their usage are those in the <code>InstanceDestruction</code> event handler.
   	    </para>
            <para>
              	 The other means by which a script instance can end are by <code>Forward</code>, being unloaded, and by crashing (such as when an unhandled exception occurs in a <link linkend=""ApiGlossary.CustomCode""><code>CustomCode</code></link> action or a native action).
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "EndScript";
            }
            public class EndFunction
            {
                public const string NAME = "EndFunction";
                public const string FULLNAME = Globals.NAMESPACE + "." + "EndFunction";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>EndFunction</code> informs the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> to end the current function.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
              	<code>EndFunction</code> causes the currently executing function to come to an end.  
	    </para>
	    <para>
	    <link linkend=""ApiGlossary.Function""><code>Functions</code></link> in scripts can only execute serially; <code>EndFunction</code> signifies to the <code>Application Runtime Environment</code> that this function is done and therefore subsequent functions can now be processed.  Due to this serial behavior, if a <link linkend=""ApiGlossary.NonTriggeringEvent""><code>non-triggering event</code></link> is routed to the script while a function is being processed, the event is <link linkend=""ApiGlossary.ScriptEventQueue"">queued</link> up until <code>EndFunction</code> is called. To make sure events are not queued excessively and your script remains responsive for incoming events, the overriding best practice is to spend as little time in a function as possible.
            </para>
	    <para>
	    	If a function is invoked via <link linkend=""Metreos.ApplicationControl.CallFunction""><code>CallFunction</code></link>, then the <link linkend=""ApiGlossary.CustomActionParams""><code>custom action parameters</code></link> of the <code>EndFunction</code> action are passed back to the to custom <link linkend=""ApiGlossary.ResultData""><code>result data</code></link> for the <code>CallFunction</code> action.  This relationship of <code>EndFunction</code> action parameters and <code>CallFunction</code> result data is based purely on the names of the parameters; one must ensure that the name of each <code>EndFunction</code> custom action parameters and <code>CallFunction</code> result data are the same string value.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	<code>EndFunction</code> is an example of a <link linkend=""ApiGlossary.Final""><code>final</code></link> action, which means no other actions can occur after this action in the function from which it was invoked.
   	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "EndFunction";
                public class Params
                {
                    public class ReturnValue
                    {
                        public const string NAME = "ReturnValue";
                        public const string DISPLAY = "ReturnValue";
                        public const string DESCRIPTION = 
@"If a function is invoked via <code>CallFunction</code>, 
then the <code>ReturnValue</code> parameter is used to dictate which <link linkend=""ApiGlossary.Branching"">branch condition</link> 
is taken once execution carries on past <code>CallFunction</code>.";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class CallFunction
            {
                public const string NAME = "CallFunction";
                public const string FULLNAME = Globals.NAMESPACE + "." + "CallFunction";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>CallFunction</code> causes the function specified by <code>FunctionName</code> to begin executing, pausing the currently executing function until the called one completes.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
              	<code>CallFunction</code> allows a developer to manually invoke a <link linkend=""ApiGlossary.Function""><code>function</code></link> (as opposed to functions being invoked automatically by the occurrence of events, which are known as <link linkend=""ApiGlossary.EventHandler""><code>event handler</code></link> functions).  One can invoke any function defined in the same script as that of the <code>CallFunction</code>.
            </para>
	    <para>
	    	One can pass in parameters to the function by using the <link linkend=""ApiGlossary.CustomActionParams""><code>custom action parameters</code></link> of <code>CallFunction</code>, which can be initialized by local variables in the called function.  The name of a custom action parameter passed in must match the <code>InitializeWith</code> property of the local variable. Also, one can use global variables in a function invoked by <code>CallFunction</code>.  
	    </para>
	    <para>
	    	If a function is invoked via <code>CallFunction</code>, then the <code>custom action parameters</code> of the <link linkend=""Metreos.ApplicationControl.EndFunction""><code>EndFunction</code></link> in the called function are passed back to the to custom <link linkend=""ApiGlossary.ResultData""><code>result data</code></link> for the <code>CallFunction</code> action in the calling function.   This relationship of <code>EndFunction</code> action parameters and <code>CallFunction</code> result data is based purely on the names of the parameters; one must ensure that the name of each <code>EndFunction</code> action parameters and <code>CallFunction</code> result data are the same string value.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	If a function invoked by <code>CallFunction</code> ends the script instance (for instance, with <link linkend=""Metreos.ApplicationControl.EndScript""><code>EndScript</code></link> or <link linkend=""Metreos.ApplicationControl.Forward""><code>Forward</code></link>), then the calling function does not have execution returned to it.
   	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "CallFunction";
                public class Params
                {
                    public class FunctionName
                    {
                        public const string NAME = "FunctionName";
                        public const string DISPLAY = "FunctionName";
                        public const string DESCRIPTION = 
@"The name of the function to invoke.  The function must exist in the same script.  Functions which are <code>event handlers</code> can also be invoked.";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class Forward
            {
                public const string NAME = "Forward";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Forward";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>Forward</code> informs the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> to destroy the script instance and route all events destinated for this script instance to the instance defined in the <code>ToGuid</code>.  
    		</para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem> 
	    <para>
	    	Once a script is ended with <code>Forward</code>, any <link linkend=""ApiGlossary.NonTriggeringEvent""><code>non-triggering events</code></link> (unsolicited or asynchronous) routed to this now-defunct script instance will be forwarded to the script instance specified in the <code>ToGuid</code> parameter.  The script instance forwarded to does not receive any notification that it was forwarded to--if this is necessary for an application then one should use <link linkend=""Metreos.ApplicationControl.SendEvent""><code>SendEvent</code></link> before the <code>Forward</code>.
	    </para>
  	    <para>
              	<code>Forward</code> unloads the resources associated the script, such as global variables.  Every script should always come to an end with either <code>Forward</code> or <link linkend=""Metreos.ApplicationControl.EndScript""><code>EndScript</code></link>; otherwise, script instances will continue to build up which consumes memory resources on the system.
            </para>
  		<para>
	    	Ending a script instance is important with regards to licensing; the <link linkend=""ApiGlossary.CUAS""><code>application server</code></link> licensing scheme is based on the amount of concurrently running scripts.  Ending a script instance with <code>Forward</code> releases one license unit.
	    </para>
     	    <para>
	    	When a script ends, the <link linkend=""Metreos.ApplicationControl.InstanceDestruction""><code>InstanceDestruction</code></link> event is fired with an <link linkend=""Metreos.ApplicationControl.InstanceDestruction.EventParams.ErrorCode""><code>ErrorCode</code></link> value of <code>1</code>.  Because this event is fired whenever the script ends for any reason (including the use of <code>Forward</code>), this provides a clean location to implement any clean-up code for the script instance.
	    </para>	  
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	While it is conceivable to create a script which acts as a singleton and all other scripts forward to it, this model may not scale well depending on the amount of events being routed to the singleton script.  Scripts execute functions sequentially (and therefore events as well), so one script instance would conceivably do a very poor job of keeping up with the number of events associated with a high number of forwarded-from script instances.  Ultimately, the ability of a script to process events is based on how much time each function takes and at what rate events are coming into the script.
   	    </para>
            <para>
              	 The other means by which a script instance can end are by <code>EndScript</code>, being unloaded, and by crashing (such as when an unhandled exception occurs in a <link linkend=""ApiGlossary.CustomCode""><code>CustomCode</code></link> action or a native action).
	    </para>
	     <para>
	    	<code>Forward</code> is an example of a <link linkend=""ApiGlossary.Final""><code>final</code></link> action, which means no other actions can occur after this action in the function from which it was invoked.  In the special case of <code>EndScript</code> or <code>Forward</code>, the only actions in the current script instance that can occur after their usage are those in the <code>InstanceDestruction</code> event handler.
   	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "Forward";
                public class Params
                {
                    public class ToGuid
                    {
                        public const string NAME = "ToGuid";
                        public const string DISPLAY = "ToGuid";
                        public const string DESCRIPTION = 
@"Must be a valid <link linkend=""ApiGlossary.RoutingGuid"">RoutingGuid</link> of a running script instance.";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class SendEvent
            {
                public const string NAME = "SendEvent";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SendEvent";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>SendEvent</code> allows a script to send an event to another script.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem> 
	    <para>
	    	The ability to send events to scripts is possible with the <code>SendEvent</code> action. Sending events is typically associated with providers; this action relies on the same internal mechanism.
	    </para>  
	    <para>
	    	<code>SendEvent</code> is capable of sending a <link linkend=""ApiGlossary.TriggeringEvent""><code>triggering event</code></link> in order to initiate a new script instance, or to send a  <link linkend=""ApiGlossary.NonTriggeringEvent""><code>non-triggering event</code></link> to a running script instance.  The determination of which type of event is sent is based on the presence of the <code>ToGuid</code> action parameter.  If empty, the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> will attempt to route the event as a triggering event to an installed script.  If a script matches the <link linkend=""ApiGlossary.EventSignature""><code>event signature</code></link> of the event, then a new script instance will be initiated and the <code>DestinationGuid</code> result data parameter will be populated with the <link linkend=""ApiGlossary.RoutingGuid""><code>RoutingGuid</code></link> of the new script.  If instead the <code>ToGuid</code> is the <code>RoutingGuid</code> of an existing script instance, a <code>non-triggering event</code> will be routed to the a running script instance, in which case <code>DestinationGuid</code> serves no purpose since it would be the same value as <code>ToGuid</code>.
	    </para>
	    <para>
	    	Just like an event originating from a provider, an event sent by an application has an event name and <code>0</code> or more <link linkend=""ApiGlossary.EventParameter""><code>event parameters</code></link> associated with it.  The event name is specified by populating the <code>EventName</code> action parameter (for example, <code>Metreos.Providers.Http.GotRequest</code> is an example of the event name associated with the built-in HTTP provider).  One must use <link linkend=""ApiGlossary.CustomActionParams""><code>custom action parameters</code></link> on the action to define <code>event parameters</code>.  The combination of the event name and <code>event parameters</code> are used to best match against the <link linkend=""ApiGlossary.EventFilterCriteria""><code>event filter criteria</code></link> of all installed scripts.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	One can enable two-way communication between scripts if one sends an event parameter in a <code>SendEvent</code> action which has the value of the originating script's <code>RoutingGuid</code> to the receiving script.  The receiving script can then extract that <code>RoutingGuid</code> with a local variable (as one extracts all event parameters), and can then send back an event by supplying the originating script's <code>RoutingGuid</code> as the <code>ToGuid</code> action parameter with its own <code>SendEvent</code> action.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "SendEvent";
                public class Params
                {
                    public class EventName
                    {
                        public const string NAME = "EventName";
                        public const string DISPLAY = "EventName";
                        public const string DESCRIPTION =
@"The name of the event to send.  Along with <code>event parameters</code> defined through custom parameters, the <code>EventName</code> comprises a part of the <code>event signature</code>.";
                        public const string DEFAULT = null;
                    }
                    public class ToGuid
                    {
                        public const string NAME = "ToGuid";
                        public const string DISPLAY = "ToGuid";
                        public const string DESCRIPTION = 
@"If not specified, <code>SendEvent</code> will sent a <code>triggering event</code> with the specified <code>EventName</code> and any <code>custom action parameters</code> as <code>event parameters</code>. 
If specified, the <code>SendEvent</code> action will instead send a <code>non-triggering event</code> to the script which has a matching <code>RoutingGuid</code>.";
                        public const string DEFAULT = null;
                    }
                }
                public class Results
                {
                    public class DestinationGuid
                    {
                        public const string NAME = "DestinationGuid";
                        public const string DISPLAY = "DestinationGuid";
                        public const string DESCRIPTION = 
@"Contains the <code>RoutingGuid</code> belonging to the script to which the event was sent to, if <code>SendEvent</code> was successful.";
                    }
                }
            }
            public class SetSessionData
            {
                public const string NAME = "SetSessionData";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SetSessionData";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>SetSessionData</code> allows one to add a key-value pair to the SessionData script variable by using <link linkend=""ApiGlossary.CustomActionParams""><code>custom action parameters</code></link>.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem> 
	    <para>
	    	This action serves no purpose currently.  It exists for backwards-compatability.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	None.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "SetSessionData";
            }
        }
        public class Events
        {
            public class StaticConstruction
            {
                public const string NAME = "StaticConstruction";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                The <code>StaticConstruction</code> event is fired whenever the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> loads the application. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem> 
	    <para>
	    	The <code>StaticConstruction</code> event is provided for developers to execute one-time logic which is needed prior to the rest of the scripts in the application being executed.
	    </para>
	    <para>
	    	It is imperative that one use the <link linkend=""Metreos.ApplicationControl.ConstructionComplete""><code>ConstructionComplete</code></link> action once the preparation tasks in the <code>StaticConstruction</code> script are complete.  Applications which define a <code>StaticConstruction</code>-triggered script have all other scripts initially loaded in a disabled status.  Scripts in this disabled state can not receive events. Once <code>ConstructionComplete</code> has been called by the <code>StaticConstruction</code>-triggered script, the rest of the scripts in the application are then enabled and are therefore able to receive events and execute.
 	    </para>
	    <para>
	    	If one chooses to not define a <code>StaticConstruction</code>-triggered script within the application, then all the scripts in the application are considered ready to be executed as soon as the application is loaded.  All the scripts in such applications are immediately enabled and are able to process events after being loaded.
  	    </para>
	    <para>
	    	Implementing the <code>StaticConstruction</code> event is completely optional.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	     <para>
A common use case for this model is when one intends to monitor the status of a group of users for presence status changes for the <link linkend=""ApiGlossary.ApplicationLifetime"">lifetime</link> of an application.  In such a case, one would want to know when the application is initially loaded, and at that time use <link linkend=""Metreos.Providers.Presence.TriggeringSubscribe""><code>TriggeringSubscribe</code></link> to establish a subscription on that group as a one-time operation.  With the <code>StaticConstruction</code> event, one has an appropriate location to apply this preparation logic.
 	     </para>
	     <para>
	    	<code>StaticConstruction</code> occurs whenever an application is loaded, which occurs whenever the application is first installed while the <link linkend=""ApiGlossary.CUAS""><code>application server</code></link> service is running, or if the application server service is first starting and is loading an already-installed application.
	    </para>
	    <para>
	    	The script initiated by the <code>StaticConstruction</code> is just like any other script, meaning it has global variables, can invoke asynchronous actions, receive unsolicited events, etc.  The only significant difference is that one should be sure to use the <code>ConstructionComplete</code> action once all the preparation tasks that are required for the execution of the other scripts are complete.
	    </para>
	    <para>
	    	An application should only define one script triggered by the <code>StaticConstruction</code> event.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "StaticConstruction";
                public const string FULLNAME = Globals.NAMESPACE + "." + "StaticConstruction";
            }
            public class InstanceDestruction
            {
                public const string NAME = "InstanceDestruction";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                The <code>InstanceDestruction</code> event is fired whenever the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> destroys an instance of a script. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem> 
	    <para>
	    	The <code>InstanceDestruction</code> event is provided for developers to execute logic which is needed immediately before an instance is unloaded.  Because scripts can end in any number of locations due to <code>EndScript</code> usage, <code>Forward</code> usage, application unloading, and by unexpected errors causing script crashes, the <code>InstanceDestruction</code> script is an ideal way to ensure that any resources that need to be cleaned deterministically occur.  A good analogy to help understand <code>InstanceDestruction</code> is the <code>try/catch/finally</code> pattern, where scripts are the code in the <code>try</code> block, application crashes occur in the <code>catch</code> block, and the <code>finally</code> block corresponds to the code in the <code>InstanceDestruction</code>-triggered script.
	    </para>    
	    <para>
	    	The <code>InstanceDestruction</code> event provides the <code>ErrorCode</code> and <code>ErrorText</code> event parameters to indicate under what circumstances did the script instance unload.
	    </para>
	    <para>
	    	Implementing the <code>InstanceDestruction</code> event is completely optional.
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	     <para>
	    	<code>InstanceDestruction</code> occurs whenever a script is ended with <code>EndScript</code>, <code>Forward</code>, abnormal exit due to unhandled exception or script error, or if the application server is unloading the application.  Refer to <link linkend=""Metreos.ApplicationControl.InstanceDestruction.EventParams.ErrorCode""><code>ErrorCode</code></link> regarding more information on specific reasons for script instance termination.
	    </para> 
	    <para>
	    	The <code>InstanceDestruction</code> event handler has up to 30 seconds to finish, by default.  This amount is configurable on an application server-wide basis.
	    </para>
	    <para>
	    	If an application is being unloaded due to the <link linkend=""ApiGlossary.CUAS""><code>application server</code></link> service stopping or if the application is being uninstalled, the script has excecution stopped immediately and then  the <code>InstanceDestruction</code> event handler is executed.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "InstanceDestruction";
                public const string FULLNAME = Globals.NAMESPACE + "." + "InstanceDestruction";
                public class Params
                {
                    public class ErrorCode
                    {
                        public const string NAME = "ErrorCode";
                        public const string DISPLAY = "ErrorCode";
                        public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>0</term>
        <listitem>
            <para>
                Is caused by use of <link linkend=""Metreos.ApplicationControl.EndScript""><code>EndScript</code></link>.  Corresponds to <code>Normal</code>. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>1</term>
        <listitem> 
	    <para>
	    	Is caused by use of <link linkend=""Metreos.ApplicationControl.Forward""><code>Forward</code></link>.  Corresponds to <code>Forwarded</code> 
	    </para>
	</listitem>
    </varlistentry>
    <varlistentry>
        <term>2</term>
        <listitem>
	     <para>
	    	Is caused by the application being unloaded, which can be due to uninstallation of the application or if the <code>application server</code> is being shutdown.  Corresponds to <code>Shutdown</code>.
	    </para> 
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>3</term>
        <listitem>
	     <para>
	    	Is caused by the application terminating due to an unexpected error in a native action, type, custom code, or other <code>Application Runtime Environment</code> error.  Corresponds to <code>Exception</code>.
	    </para> 
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>4</term>
        <listitem>
	     <para>
	    	Is caused by the application terminating due to a script error, such as an branch condition being returned by an action which was not defined in the script at design time.  Corresponds to <code>ScriptError</code>.
	    </para> 
        </listitem>
	<varlistentry>
        <term>5</term>
        <listitem>
	     <para>
	    	Reserved for future use.
	    </para> 
        </listitem>
    </varlistentry>
    </varlistentry>
</variablelist>";
                    }
                    public class ErrorText
                    {
                        public const string NAME = "ErrorText";
                        public const string DISPLAY = "ErrorText";
                        public const string DESCRIPTION = 
@"An error message describing the specific reason that the application ended.";
                    }
                }
            }
        }
    }
public class CallControl
    {
        public class Globals
        {
            public const string NAMESPACE = "Metreos.CallControl";
            public const string PACKAGE_NAME = "Metreos.CallControl";
            public const string PACKAGE_DESCRIPTION = "This is defined in the callcontrol generator tool";
        }
        public class Actions
        {
            public class MakeCall
            {
                public const string NAME = "MakeCall";
                public const string FULLNAME = Globals.NAMESPACE + "." + "MakeCall";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	Places an outbound call from the application server to a specified destination.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		<code>MakeCall</code> will place a call to the destination specified by <code>To</code>.  The resulting call leg, if <link linkend=""Metreos.CallControl.MakeCall_Complete"">completed</link>, is a VOIP 'bridge' between the application server and the endpoint which answered the call, which could be a phone, voicemail, or another application.  The practical use of <code>MakeCall</code> is to establish a call and media connection with a remote endpoint, essentially bringing a script into a telephony conversation and opening up the ability to utilize the other actions and events in the <link linkend=""ApiGlossary.CallControl"">Call Control</link> and <link linkend=""Metreos.MediaControl"">Media Control</link> APIs.
	    </para>
	    <para>
		The application has little control over where the call is routed beyond the application server. See <link linkend=""ApiGlossary.CallRouting"">Call Routing</link> for more information on how the application server interfaces with the outside world for the routing of calls.
	    </para>
	    <para>
	    	The <code>CallId</code> result data parameter is the unique identifier for this call.  All Call Control API actions and events use <code>CallId</code>, so practically the application developers almost always stores this <code>CallId</code> value in a variable for the use in subsequent Call Control operations.  This <code>CallId</code> should not be considered unique across multiple application servers.
	    </para>
	    <para>
	     	Once a call is placed with <code>MakeCall</code>, it will either eventually complete with the <link linkend=""Metreos.CallControl.MakeCall_Complete""><code>MakeCall_Complete</code></link> event, meaning the call is answered and audio is flowing, or the call will fail with the <link linkend=""Metreos.CallControl.MakeCall_Failed""><code>MakeCall_Failed</code></link> event, meaning the call is over (and the <code>CallId</code> for the call is no longer valid). There are a number of reasons why a call can fail to establish.  When a calls fails to complete, the <code>MakeCall_Failed</code> event fires, with an <link linkend=""Metreos.CallControl.MakeCall_Failed.EventParams.EndReason""><code>EndReason</code></link> event parameter indicating why the call failed.
	    </para>
	    <para>
	    	As soon as a call is made, a number of unsolicited events can potentially occur, based on activity occurring in the call.  These are <link linkend=""Metreos.CallControl.GotDigits""><code>GotDigits</code></link>, <link linkend=""Metreos.CallControl.RemoteHangup""><code>RemoteHangup</code></link>, <link linkend=""Metreos.CallControl.StartTx""><code>StartTx</code></link>, <link linkend=""Metreos.CallControl.StopTx""><code>StopTx</code></link>, and <link linkend=""Metreos.CallControl.StartRx""><code>StartRx</code></link>.
	    </para>
	    <para>
	    	One can abort a 'ringing' call not yet established (a call is established, or completed, when the <code>MakeCall_Complete</code> event occurs) by using <link linkend=""Metreos.CallControl.Hangup""><code>Hangup</code></link>.  To do so, supply to the <code>Hangup</code> action the <code>CallId</code> value returned as result data of the <code>MakeCall</code> action. 
    	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	An audio connection between the called destination and media engine is created automatically when one uses <code>MakeCall</code>, except for calls that are designated as <link linkend=""ApiGlossary.P2P"">peer-to-Peer</link> by the <code>PeerCallId</code> action parameter.  The application server automatically uses <link linkend=""Metreos.MediaControl.ReserveConnection""><code>ReserveConnection</code></link> and <link linkend=""Metreos.MediaControl.CreateConnection""><code>CreateConnection</code></link> while the call is being established with the remote endpoint, with the end result of a valid <code>ConnectionId</code> being made available in the resulting <code>MakeCall_Complete</code>.  This <code>ConnectionId</code> can then be used by the Media Control API.
    	    </para>
	    <para>
	    	When the call is hung up by either party, the <code>ConnectionId</code> is destroyed automatically by the application server.
	    </para>
	    <para>
	    The script does not have direct control over which telephony protocol is when placing the call, or which Cisco Unified Communications Manager is used to send the call to.  The protocol used, and the Cisco Unified Communications Manager that is signalled when making the call, is determined by the configured <link linkend=""ApiGlossary.CallRouteGroup"">Call Route Group</link> on the current <link linkend=""ApiGlossary.ApplicationPartition"">application partition</link>. 
	    </para>
	    <para>
	    	The script does not have direct control over which media engine is used when placing the call, unless <code>MmsId</code> is specified.  In the case that <code>MmsId</code> is not specified, the media engine used to process the audio connection is determined by the current <link linkend=""ApiGlossary.MediaResourceGroup""><code>Media Resource Group</code></link> on the current application partition.  
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
	    <para>
	    	The <link linkend=""ApiGlossary.ReserveMediaEarly""><code>Reserve Media Early</code></link> configuration on the script instance partition specifies whether a media engine connection should be provisioned with <code>ReserveConnection</code> as soon as the call is initiated, or if the application server should wait to until the media negotiation phase of the call ensues before reserving the connection.  The media negotiation phase often comes as the call is answered by the remote endpoint, but can also come before the call is answered as well.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "MakeCall";
                public class Params
                {
                    public class To
                    {
                        public const string NAME = "To";
                        public const string DISPLAY = "To";
                        public const string DESCRIPTION = 
@"The destination number for this call.  
In practice, this number must be routable according to the dial plan of the Cisco Unified Communications Manager cluster that the call is sent to.
All telephony protocols support this field.";
                        public const string DEFAULT = null;
                    }
                    public class From
                    {
                        public const string NAME = "From";
                        public const string DISPLAY = "From";
                        public const string DESCRIPTION = 
@"The calling number, or 'caller ID', to present for this call.
Not all telephony protocols support this field; please consult the Call Control Feature Matrix.";
                        public const string DEFAULT = null;
                    }
                    public class DisplayName
                    {
                        public const string NAME = "DisplayName";
                        public const string DISPLAY = "DisplayName";
                        public const string DESCRIPTION = 
@"A free string which describes the initiator of the call.
Not all telephony protocols support this field; please consult the Call Control Feature Matrix.";
                        public const string DEFAULT = null;
                    }
                    public class MmsId
                    {
                        public const string NAME = "MmsId";
                        public const string DISPLAY = "MmsId";
                        public const string DESCRIPTION = 
@"The ID of the media engine to create the connection on.  
If no MmsId is specified when using <code>MakeCall</code>, a media engine with the most available resources is dynamically selected from the Media Resource Group
associated with the partition of the script instance from which <code>MakeCall</code> is invoked.";
                        public const string DEFAULT = null;
                    }
                    public class PeerCallId
                    {
                        public const string NAME = "PeerCallId";
                        public const string DISPLAY = "PeerCallId";
                        public const string DESCRIPTION = 
@"The <code>CallId</code> of an unanswered incoming call that has triggered a script instance via the <link linkend=""Metreos.CallControl.IncomingCall""><code>IncomingCall</code></link> event.  Once the call placed by this <code>MakeCall</code> is completed, the call specified by this action parameter is automatically answered by the application server and the media streams are established in a peer-to-peer relationship.";
                        public const string DEFAULT = null;
                    }
                    public class ProxyDTMFCallId
                    {
                        public const string NAME = "ProxyDTMFCallId";
                        public const string DISPLAY = "ProxyDTMFCallId";
                        public const string DESCRIPTION = 
@"The <code>CallId</code> to establish a proxy relationship with.  Any digits received on one call leg will be proxied to the other.  
If <code>ProxyDTMFCallId</code> is not set and <code>PeerCallId</code> is, then the call specified by <code>PeerCallId</code> will be used for this action parameter.";  
                        public const string DEFAULT = null;
                    }
                    public class WaitForMedia
                    {
                        public const string NAME = "WaitForMedia";
                        public const string DISPLAY = "WaitForMedia";
                        public const string DESCRIPTION = 
@"Indicates what degree of media negotiation must be established before the call is considered completed.  A completed call results in the <code>MakeCall_Complete</code> event being fired. Valid values are as follows:
<variablelist>
    <varlistentry>
        <term>None</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered, regardless of the state of media negotiation.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Tx</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered and the remote endpoint has specified the properties of the audio stream that it wants transmitted to it.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Rx</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered and the application server has specified the properties of the audio stream that it wants transmitted to the media engine.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Rx</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered, the remote endpoint has specified the properties of the audio stream that it wants transmitted to it, and the application server has specified the properties of the audio stream that it wants transmitted to the media engine.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>
Note that depending on the value chosen, <code>MakeCall_Complete</code> event parameters relating to the negotiated media information may not be valid yet because the media negotiation may not yet be completed.";
                        public const string DEFAULT = "TxRx";
                    }
                    public class Conference
                    {
                        public const string NAME = "Conference";
                        public const string DISPLAY = "Conference";
                        public const string DESCRIPTION = 
@"Indicates that this call is to be placed in a conference.  If a <code>ConferenceId</code> is not specified or is set to <code>0</code>, then a new conference is created on the media engine and the <link linkend=""Metreos.CallControl.MakeCall_Complete.EventParams.ConferenceId""><code>ConferenceId</code></link> in the <code>MakeCall_Complete</code> event is the unique identifier for that new conference (assuming <code>WaitForMedia</code> is the default <code>TxRx</code>).  If a <code>ConferenceId</code> is specified, then the connection created for this call is moved into the existing conference as soon as the media channels for the call have been fully established.";
                        public const string DEFAULT = "False";
                    }
                    public class ConferenceId
                    {
                        public const string NAME = "ConferenceId";
                        public const string DISPLAY = "ConferenceId";
                        public const string DESCRIPTION =
@"The <code>ConferenceId</code> of the conference to add this call to. Specify no value or <code>0</code> if this is to be a new conference.  This field is ignored if <code>Conference</code> is <code>false</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Hairpin
                    {
                        public const string NAME = "Hairpin";
                        public const string DISPLAY = "Hairpin";
                        public const string DESCRIPTION = 
@"Indicates that the new conference should be optimized for two parties.  A hairpinned conference does not use any conference resources.  However, a hairpin conference will be 'promoted', or converted to a true media conference, if a 3rd participant is added to the conference or if a voice operation is performed on the conference itself.  In either case, this will cause each participant and conferenced voice operation to use one conference resource.  True conferences also have a slightly increased latency over a hairpinned conference.";
                        public const string DEFAULT = "True";
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
                public class Results
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = 
@"Unique identifier used to identify this call in all subsequent Call Control API operations.
This is the same value that will be returned as the event parameter <code>CallId</code>
in the <code>MakeCall_Complete</code> event
or in the <code>MakeCall_Failed</code> event.";
                    }
                }
            }
            public class Barge
            {
                public const string NAME = "Barge";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Barge";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	Requests to be in an impromptu conference with an active call that has been established on a shared line.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	   	<code>Barge</code> allows one to push an application into the audio streams of an active call previously uncontrolled by the application server, by causing the call to conference in a Media Server connection. The conferencing (mixing of audio) is handled by the phone in this case, not the media engine.  	If <code>MediaRxIP</code> and <code>MediaRxPort</code> are specified, a connection will not be made on the media server, and instead the phone will send the conferenced audio to that specified Rx location.
	    </para>
            <para>
	    	When the call is ended by either party, the <code>ConnectionId</code> is destroyed automatically by the application server.
	    </para>
	    <para>
	    	<code>Barge</code> offers a means to overcome the difficult problem of gaining control of the media streams without having control over the call.  However, <code>Barge</code> requires a significant amount of configuration in the deployment.  To invoke <code>Barge</code> successfully, one has to have deployed a Cisco Unified Application Environment virtual SCCP phone in a shared-line configuration with an existing phone that needs to be barged into.  Also, <code>Barge</code> will only work if the real phone has been configured to use its built-in device bridge.  Finally, it is only valid to invoke <code>Barge</code> while the call is active--typically this knowledge is gained by also using JTAPI <link linkend=""Metreos.Providers.JTapiProvider.JTapiCallActive""><code>JTapiCallActive</code></link> events to know when the real phone has an active call.
	    </para>
	    </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	         A connection is created only if <code>MediaRxIP</code> and <code>MediaRxPort</code> are not specified.  In this case, it is also important to consider that the script does not have direct control over which media engine is used to create a connection when barging.  The media engine used to process the audio connection is determined by the current <link linkend=""ApiGlossary.MediaResourceGroup""><code>Media Resource Group</code></link> on the current <link linkend=""ApiGlossary.ApplicationPartition"">application partition</link>.  
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "Barge";
                public class Params
                {
                    public class From
                    {
                        public const string NAME = "From";
                        public const string DISPLAY = "Line DN";
                        public const string DESCRIPTION = 
@"The directory number of the shared line to barge into.";
                        public const string DEFAULT = null;
                    }
                    public class MediaRxIP
                    {
                        public const string NAME = "MediaRxIP";
                        public const string DISPLAY = "Rx IP";
                        public const string DESCRIPTION = 
@"The IP address that the conferenced audio should be sent to.  If <code>MediaRxIP</code> is not specified along with <code>MediaRxPort</code>, then a connection is created automatically which has Tx and Rx streams bridged appropriately from the conference to the media engine.";
                        public const string DEFAULT = null;
                    }
                    public class MediaRxPort
                    {
                        public const string NAME = "MediaRxPort";
                        public const string DISPLAY = "Rx Port";
                        public const string DESCRIPTION = "The port that the conferenced audio should be sent to. If <code>MediaRxPort</code> is not specified along with <code>MediaRxIP</code>, then a connection is created automatically which has Tx and Rx streams bridged appropriately from the conference to the media engine.";
                        public const string DEFAULT = null;
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
                public class Results
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = 
@"Unique identifier used to identify this call in all subsequent <link linkend=""ApiGlossary.CallControl"">Call Control</link> operations.";
                    }
                    public class MmsId
                    {
                        public const string NAME = "MmsId";
                        public const string DISPLAY = "MmsId";
                        public const string DESCRIPTION =
@"Unique identifier used to identify the media engine in control of this connection.  
A common use for this ID is to ensure that other connections which will ultimately be conferenced with this connection are all created on the same media engine.  
This correlation is necessary because all connections in a single conference must all reside on the same media engine.";
                    }
                    public class ConnectionId
                    {
                        public const string NAME = "ConnectionId";
                        public const string DISPLAY = "ConnectionId";
                        public const string DESCRIPTION = 
@"Unique identifier used to identify this connection in all subsequent <link linkend=""Metreos.MediaControl"">Media Control</link> API operations.
A value is returned only if <code>MediaRxIP</code> and <code>MediaRxPort</code> were not specified.";
                    }
                    public class MediaTxIP
                    {
                        public const string NAME = "MediaTxIP";
                        public const string DISPLAY = "MediaTxIP";
                        public const string DESCRIPTION = 
@"The IP address that the barging in party should send audio to.  If a connection was created by this action, this value is already associated with that connection.";
                    }
                    public class MediaTxPort
                    {
                        public const string NAME = "MediaTxPort";
                        public const string DISPLAY = "MediaTxPort";
                        public const string DESCRIPTION =
@"The port that the barging in party should send audio to.  If a connection was created by this action, this value is already associated with that connection.";
                    }
                    public class MediaTxCodec
                    {
                        public const string NAME = "MediaTxCodec";
