                }
            }
            public class AcceptCall
            {
                public const string NAME = "AcceptCall";
                public const string FULLNAME = Globals.NAMESPACE + "." + "AcceptCall";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	Accepts an incoming call, indicating to the remote endpoint that the called party is present and may subsequently answer.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	    	When a call is inbound to an script via <link linkend=""Metreos.CallControl.IncomingCall""><code>IncomingCall</code></link>, the call is in a ringing state and a script can choose to do one of 5 things: <code>AcceptCall</code>, <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link>, <link linkend=""Metreos.CallControl.Redirect""><code>Redirect</code></link>, <link linkend=""Metreos.CallControl.RejectCall""><code>RejectCall</code></link>, or simply do nothing with the call. The practical use of <code>Accept</code> is to extend the amount of time that the call will remain in a ringing state, buying the application more time to perform logic before commiting to answering or rejecting the call.
	    </para>
	    <para>
		From the perspective of the script instance initiated by the incoming call, the telephony protocol of the call has already been chosen by the time <code>IncomingCall</code> has been fired.  However, any call created by the application via <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link> or <link linkend=""Metreos.CallControl.Barge""><code>Barge</code></link> will use the protocol configured on the <link linkend=""ApiGlossary.ApplicationPartition"">application partition</link> of the script instance.  See <link linkend=""ApiGlossary.CallRouting"">Call Routing</link> for more information on how the application server interfaces with the outside world for the routing of calls.
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	An audio connection between the called destination and media engine is created automatically when one uses <code>Accept</code> call, provided that <link linkend=""ApiGlossary.ReserveMediaEarly""><code>Reserve Media Early</code></link> is set to <code>true</code> on the partition of the script instance.  The application server automatically uses <link linkend=""Metreos.MediaControl.ReserveConnection""><code>ReserveConnection</code></link>, with the end result of a valid <code>ConnectionId</code> being made available in the <code>ConnectionId</code> result data. This <code>ConnectionId</code> can then be used by the <link linkend=""Metreos.MediaControl"">Media Control</link> API.
    	    </para>
	    <para>
	    	When the call is ended by either party, the <code>ConnectionId</code> is destroyed automatically by the application server.
	    </para>
	    <para>
	    	The script does not have direct control over which media engine is used when accepting the call. The media engine used to process the audio connection is determined by the current <link linkend=""ApiGlossary.MediaResourceGroup""><code>Media Resource Group</code></link> on the current application partition.  
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "AcceptCall";
                public class Params
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = "Indicates the call to accept with <code>AcceptCall</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
