            public class AnswerCall
            {
                public const string NAME = "AnswerCall";
                public const string FULLNAME = Globals.NAMESPACE + "." + "AnswerCall";
                public const string DESCRIPTION =
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	Answers an incoming call, indicating to the remote endpoint that the called party is willing to participate in the call.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	    	When a call is inbound to an script via <link linkend=""Metreos.CallControl.IncomingCall""><code>IncomingCall</code></link>, the call is in a ringing state and a script can choose to do one of 5 things: <code>AnswerCall</code>, <link linkend=""Metreos.CallControl.AcceptCall""><code>AcceptCall</code></link>, <link linkend=""Metreos.CallControl.Redirect""><code>Redirect</code></link>, <link linkend=""Metreos.CallControl.RejectCall""><code>Reject</code></link>, or simply do nothing with the call. The practical use of <code>Answer</code> is to establish a call and media connection with a remote endpoint, essentially bringing a script into a telephony conversation and opening up the ability to utilize the other actions and events in the <link linkend=""ApiGlossary.CallControl"">Call Control</link> and <link linkend=""Metreos.MediaControl"">Media Control</link> APIs.
	    </para>
	    <para>
		From the perspective of the script instance initiated by the incoming call, the telephony protocol of the call has already been chosen by the time <code>IncomingCall</code> has been fired.  However, any call created by the application via <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link> or <link linkend=""Metreos.CallControl.Barge""><code>Barge</code></link> will use the protocol configured on the partition of the script instance.  See <link linkend=""ApiGlossary.CallRouting"">Call Routing</link> for more information on how the application server interfaces with the outside world for the routing of calls.
	    </para>
	    <para>
	    	As soon as a call is answered, a number of unsolicited events can potentially occur.  These are <link linkend=""Metreos.CallControl.GotDigits""><code>GotDigits</code></link>, <link linkend=""Metreos.CallControl.RemoteHangup""><code>RemoteHangup</code></link>, <link linkend=""Metreos.CallControl.StartTx""><code>StartTx</code></link>, <link linkend=""Metreos.CallControl.StopTx""><code>StopTx</code></link>, and <link linkend=""Metreos.CallControl.StartRx""><code>StartRx</code></link>.
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	An audio connection between the called destination and media engine is created automatically when one uses <code>Answer</code>.  The application server automatically uses <link linkend=""Metreos.MediaControl.ReserveConnection""><code>ReserveConnection</code></link> and <link linkend=""Metreos.MediaControl.CreateConnection""><code>CreateConnection</code></link> while the call is being established with the remote endpoint, with the end result of a valid <code>ConnectionId</code> result data parameter. This <code>ConnectionId</code> can then be used by the Media Control API.
    	    </para>
	    <para>
	    	When the call is hung up by either party, the <code>ConnectionId</code> is destroyed automatically by the application server.
	    </para>
	    <para>
	    	The script does not have direct control over which media engine is used when answering the call, unless <code>MmsId</code> is specified.  In the case that <code>MmsId</code> is not specified, the media engine used to process the audio connection is determined by the current <link linkend=""ApiGlossary.MediaResourceGroup""><code>Media Resource Group</code></link> on the current <link linkend=""ApiGlossary.ApplicationPartition"">application partition</link>.  
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
	    <para>
	    	The <code>Reserve Media Early</code> configuration on the script instance partition specifies whether a media engine connection should be provisioned with <code>ReserveConnection</code> as soon as the call is initiated, or if the application server should wait to until the media negotiation phase of the call ensues before reserving the connection.  The media negotiation phase often comes as the call is answered by the remote endpoint, but can also come before.  Due to the small amount of time <code>AnswerCall</code> usually takes to complete, <code>Reserve Media Early</code> is less important compared to the impact it has on <code>MakeCall</code>.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "AnswerCall";
                public class Params
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = "Indicates the call to answer with <code>AnswerCall</code>.";
                        public const string DEFAULT = null;
                    }
                    public class DisplayName
                    {
                        public const string NAME = "DisplayName";
                        public const string DISPLAY = "DisplayName";
                        public const string DESCRIPTION = 
@"A free string which describes the initiator of the call.
Not all telephony protocols support this field; please consult the Call Control Feature Matrix.";
                        public const string DEFAULT = null;
                    }
                    public class MmsId
                    {
                        public const string NAME = "MmsId";
                        public const string DISPLAY = "MmsId";
                        public const string DESCRIPTION =
@"The ID of the media engine to create the connection on.  
If no MmsId is specified when using <code>AnswerCall</code>, a media engine with the most available resources is dynamically selected from the Media Resource Group
associated with the partition of the script instance from which <code>AnswerCall</code> is invoked.";
                        public const string DEFAULT = null;
                    }
                    public class ProxyDTMFCallId
                    {
                        public const string NAME = "ProxyDTMFCallId";
                        public const string DISPLAY = "ProxyDTMFCallId";
                        public const string DESCRIPTION =
@"The <code>CallId</code> to establish a proxy relationship with.  Any digits received on one call leg will be proxied to the other.";
                        public const string DEFAULT = null;
                    }
                    public class WaitForMedia
                    {
                        public const string NAME = "WaitForMedia";
                        public const string DISPLAY = "WaitForMedia";
                        public const string DESCRIPTION =
@"Indicates what degree of media negotiation must be established before the call is considered answered.  An answered call results in the successful completion of the <code>AnswerCall</code> action. Valid values are as follows:
<variablelist>
    <varlistentry>
        <term>None</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered, regardless of the state of media negotiation.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Tx</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered and the remote endpoint has specified the properties of the audio stream that it wants transmitted to it.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Rx</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered and the application server has specified the properties of the audio stream that it wants transmitted to the media engine.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Rx</term>
        <listitem>
            <para>
            	Indicates that the call should be considered completed as soon as the call control signaling has indicated that the call is answered, the remote endpoint has specified the properties of the audio stream that it wants transmitted to it, and the application server has specified the properties of the audio stream that it wants transmitted to the media engine.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>.  Note that depending on the value chosen, the result data parameters relating to the negotiated media information may not be valid yet because the media negotiation may not yet be completed.";
                        public const string DEFAULT = "TxRx";
                    }
                    public class Conference
                    {
                        public const string NAME = "Conference";
                        public const string DISPLAY = "Conference";
                        public const string DESCRIPTION =
@"Indicates that this call is to be placed in a conference.  If a <code>ConferenceId</code> is not specified or is set to <code>0</code>, then a new conference is created on the media engine and the <link linkend=""Metreos.CallControl.AnswerCall.ResultData.ConferenceId""><code>ConferenceId</code></link> is the unique identifier for that new conference (assuming <code>WaitForMedia</code> is the default <code>TxRx</code>).  If a <code>ConferenceId</code> is specified, then the connection created for this call is moved into the existing conference as soon as the media channels for the call have been fully established.";
                        public const string DEFAULT = "False";
                    }
                    public class ConferenceId
                    {
                        public const string NAME = "ConferenceId";
                        public const string DISPLAY = "ConferenceId";
                        public const string DESCRIPTION = 
@"The <code>ConferenceId</code> of the conference to add this call to. Specify no value or <code>0</code> if this is to be a new conference.  This field is ignored if <code>Conference</code> is <code>false</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Hairpin
                    {
                        public const string NAME = "Hairpin";
                        public const string DISPLAY = "Hairpin";
                        public const string DESCRIPTION =
@"Indicates that the new conference should be optimized for two parties.  A hairpinned conference does not use any conference resources.  However, a hairpin conference will be 'promoted', or converted to a true media conference, if a 3rd participant is added to the conference or if a voice operation is performed on the conference itself.  In either case, this will cause each participant and conferenced voice operation to use one conference resource.  True conferences also have a slightly increased latency over a hairpinned conference.";
                        public const string DEFAULT = null;
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
