            public class RejectCall
            {
                public const string NAME = "RejectCall";
                public const string FULLNAME = Globals.NAMESPACE + "." + "RejectCall";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	Rejects an incoming call, indicating to the remote endpoint that the called party is not able to receive this call.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	    	When a call is inbound to an script via <link linkend=""Metreos.CallControl.IncomingCall""><code>IncomingCall</code></link>, the call is in a ringing state and a script can choose to do one of 5 things: <code>RejectCall</code>, <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link>, <link linkend=""Metreos.CallControl.Redirect""><code>Redirect</code></link>, <link linkend=""Metreos.CallControl.AcceptCall""><code>AcceptCall</code></link>, or simply do nothing with the call. The practical use of <code>Reject</code> is to indicate to the calling party that their call could not be completed.
	    </para>
	    <para>
		From the perspective of the script instance initiated by the incoming call, the telephony protocol of the call has already been chosen by the time <code>IncomingCall</code> has been fired.  However, any call created by the application via <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link> or <link linkend=""Metreos.CallControl.Barge""><code>Barge</code></link> will use the protocol configured on the partition of the script instance.  See <link linkend=""ApiGlossary.CallRouting"">Call Routing</link> for more information on how the application server interfaces with the outside world for the routing of calls.
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "RejectCall";
                public class Params
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = "Indicates the call to reject with <code>RejectCall</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION =  "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class Hangup
            {
                public const string NAME = "Hangup";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Hangup";
                public const string DESCRIPTION = 
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	    	Ends a call.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	  	<para>
			<code>Hangup</code> allows one to end a call that was previously created by a successful <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link>, <link linkend=""Metreos.CallControl.AnswerCall""><code>MakeCall</code></link>, or <link linkend=""Metreos.CallControl.Barge""><code>Barge</code></link>. 
		</para>
		<para>
			<code>Hangup</code> can also be used to abort an uncompompleted, ringing outbound call that has been placed with <code>MakeCall</code>.
		</para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	When the call is hung up, a call that is not in a <link linkend=""ApiGlossary.P2P"">peer-to-peer</link> relationship has the associated <code>ConnectionId</code> destroyed automatically; there is no need to use <link linkend=""Metreos.MediaControl.DeleteConnection""><code>DeleteConnection</code></link> with a call that has been hungup.  Note that the behavior for a call in a peer-to-peer relationship is significantly different.  The other call established as a peer is also hung up.  There is no media connection associated with either call in a peer-to-peer relationship so there is no media connection cleanup in that regard.
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "Hangup";
                public class Params
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = "Indicates the call to hangup with <code>Hangup</code>.";
                        public const string DEFAULT = null;
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class BridgeCalls
            {
                public const string NAME = "BridgeCalls";
                public const string FULLNAME = Globals.NAMESPACE + "." + "BridgeCalls";
                public const string DESCRIPTION =
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	  <code>BridgeCalls</code> will cause both call legs in a <link linkend=""ApiGlossary.P2P"">peer-to-peer</link> relationship to renegotiate their audio streams to instead transmit and receive audio to a media engine; in the process creating two new media engine connections.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	   <para>
	   	Calls in a peer-to-peer relationship stream media directly to one another, bypassing the media engine.  This is advantageous if there is no reason to perfom <link linkend=""Metreos.MediaControl"">Media Control</link> API operations on the calls; however, if at some point during the call media control is needed, then <code>BridgeCalls</code> is a means to cause both calls to renegotiate their audio streams and begin streaming to and from the media engine.  Using this action creates two media engine connections, one for each call.
	   </para>
	   <para>
	   	Either <code>CallId</code> in the peer-to-peer call can be used as the <code>CallId</code> action parameter of this action.
	   </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	   <para>
	   	Using <code>BridgeCalls</code> completely removes the peer-to-peer relationship of the call; however, internal to the application server, the peer-to-peer relationship of the two <code>CallId</code> participants is retained, which allows one to specify the callId of just one of these calls in the <link linkend=""Metreos.CallControl.UnbridgeCalls.ActionParams.CallId""><code>CallId</code></link> action parameter in <link linkend=""Metreos.CallControl.UnbridgeCalls""><code>UnbridgeCalls</code></link> (as opposed to having to specify <link linkend=""Metreos.CallControl.UnbridgeCalls.ActionParams.PeerCallId""><code>PeerCallId</code></link> as well).
	   </para>
	    <para>
