            public class UnbridgeCalls
            {
                public const string NAME = "UnbridgeCalls";
                public const string FULLNAME = Globals.NAMESPACE + "." + "UnbridgeCalls";
                public const string DESCRIPTION = 
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	  <code>UnbridgeCalls</code> will cause the two call legs specified to form a <link linkend=""ApiGlossary.P2P"">peer-to-peer</link> relationship, in the process renegotiating their audio streams to receive and transmit to each other, bypassing the media engine.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	   <para>
	   	Two calls in a <link linkend=""Metreos.MediaControl"">Media Control</link> API-driven conference both stream media to and from the media engine.  Each in such a scenario has its own media engine connection.  This is advantageous if there is reason to perfom Media Control API operations on the calls or the conference; however, if at some point during the call media control is no longer needed, then <code>UnbridgeCalls</code> is a means to cause both the rcemote endpoints of both calls to renegotiate their audio streams and begin streaming to and from each other.  Using this action destroys the two existing media engine connections, minimizing the licensing impact of your application.
	   </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
			Using <code>UnbridgeCalls</code> is one way to create a peer-to-peer relationship between two calls.  Another way is to use the <link linkend=""Metreos.CallControl.MakeCall.ActionParams.PeerCallId""><code>PeerCallId</code></link> action parameter of <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link>, which is appropriate for certain scenarios.  In either case, once a peer-to-peer relationship has been created between two call legs, those calls thereafter can only be in a peer-to-peer relationship with each other.
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "UnbridgeCalls";
                public class Params
                {
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = 
@"An established call leg to become one party of the peer-to-peer call.";
                        public const string DEFAULT = null;
                    }
                    public class PeerCallId
                    {
                        public const string NAME = "PeerCallId";
                        public const string DISPLAY = "PeerCallId";
                        public const string DESCRIPTION = 
@"An established call leg which will be linked to <code>CallId</code> in a peer-to-peer fashion. 
You do not need to specify this value if a peer relationship has already been established between the two calls previously. 
Further you cannot use this field to change to a different peer if one has already been established.";
                        public const string DEFAULT = null;
                    }
                    public class Timeout
                    {
                        public const string NAME = "Timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = 
"The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
            }
            public class BlindTransfer
            {
                public const string NAME = "BlindTransfer";
                public const string FULLNAME = Globals.NAMESPACE + "." + "BlindTransfer";
                public const string DESCRIPTION =
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	    	Transfers the application server's side of an established call to the specified destination.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		<code>BlindTransfer</code> allows one to attempt to send an already-established call to the destination specified by the <code>To</code> parameter.  The transfer attempt is known as 'blind' because, from the application server's standpoint, the result of the transfer attempt is not known after the transfer is complete.
