            public class Redirect
            {
                public const string NAME = "Redirect";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Redirect";
                public const string DESCRIPTION = 
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	    	Redirects the application server's side of a pending call to the specified destination.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		<code>Redirect</code> allows one to attempt to send a pending incoming call (non-answered) to the destination specified by the <code>To</code> parameter.  From the application server's standpoint, the result of the redirect attempt is never known. 
	    </para>
 	    <para>
	    	When a call is inbound to an script via <link linkend=""Metreos.CallControl.IncomingCall""><code>IncomingCall</code></link>, the call is in a ringing state and a script can choose to do one of 5 things: <code>Redirect</code>, <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link>, <link linkend=""Metreos.CallControl.RejectCall""><code>RejectCall</code></link>, <link linkend=""Metreos.CallControl.AcceptCall""><code>AcceptCall</code></link>, or simply do nothing with the call. The practical use of <code>Redirect</code> is to send a call somewhere else other than the original destination.
	    </para>
	    <para>
		The specified <code>CallId</code> of the call is destroyed after this operation has completed successfully.
	    </para>
	    <para>
		With an application that is using <code>Redirect</code>, keep in mind that eventually the incoming call attempt will timeout and the opportunity to <code>Redirect</code> will have passed.  There is no way to retreive or otherwise restore the incoming call if the call attempt times out.
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
