            public class SendUserInput
            {
                public const string NAME = "SendUserInput";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SendUserInput";
                public const string DESCRIPTION =
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	    	Sends the specified digits to a call leg.
