        public class Events
        {
            public class IncomingCall
            {
                public const string NAME = "IncomingCall";
                public const string DESCRIPTION = 
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
            	  <code>IncomingCall</code> indicates that a call has been received by the application server.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	    	When a call is inbound to an script via <code>IncomingCall</code>, the call is in a ringing state and a script can choose to do one of 5 things: <link linkend=""Metreos.CallControl.RejectCall""><code>RejectCall</code></link>, <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link>, <link linkend=""Metreos.CallControl.Redirect""><code>Redirect</code></link>, <link linkend=""Metreos.CallControl.AcceptCall""><code>AcceptCall</code></link>, or simply do nothing with the call.
	    </para>
	    <para>
	    	The <link linkend=""Metreos.CallControl.RemoteHangup""><code>RemoteHangup</code></link> event can occur after <code>IncomingCall</code>, even if the call has not been answered.  In this case, just as when the call has been answered and is established, it indicates that the remote endpoint has terminated the call, and the call is over.
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "IncomingCall";
