                        public const string DESCRIPTION = 
@"Unique identifier used to identify this call leg in all subsequent <link linkend=""Metreos.CallControl"">Call Control</link> API operations, such as <code>RejectCall</code>, <code>AnswerCall</code>, <code>Redirect</code>, or <code>AcceptCall</code>.";
