@"The called number for this call.  
This number may not correspond to the number the remote endpoint initially dialed.";
                    }
                    public class OriginalTo
                    {
                        public const string NAME = "OriginalTo";
                        public const string DISPLAY = "OriginalTo";
                        public const string DESCRIPTION = 
@"The original number which was dialed. 
This will be the same as the To field unless the call has been redirected, transferred, or translated while being routed.";
                    }
