            public class RemoteHangup
            {
                public const string NAME = "RemoteHangup";
                public const string DESCRIPTION =
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
		<code>RemoteHangup</code> indicates that call has been terminated by the remote endpoint.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	   <para>
	    	<code>RemoteHangup</code> is fired when a call is terminated by the remote party for any reason. 
		If the call has been successfully answered with <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link>, 
		then the associated <code>ConnectionId</code> is automatically destroyed and is defunct.  
		If however the call is in a <link linkend=""ApiGlossary.P2P"">peer-to-peer</link> relationship, 
		then the other call leg in this peer-to-peer call is automatically hung up as well.
