                    public class EndReason
                    {
                        public const string NAME = "EndReason";
                        public const string DISPLAY = "EndReason";
                        public const string DESCRIPTION =
@"The condition which caused the call leg to terminate.  Note that the underlying protocol puts inherent limitations on how well each <code>EndReason</code> is supported. Possible values for <code>EndReason</code> are as follows:
<variablelist>
    <varlistentry>
        <term>Normal</term>
        <listitem>
            <para>
