            public class GotDigits
            {
                public const string NAME = "GotDigits";
                public const string DESCRIPTION = 
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
		<code>GotDigits</code> indicates that digit(s) have been received on the call control protocol signaling path, for a a particular <code>CallId</code>
	    </para>
