            public class StartTx
            {
                public const string NAME = "StartTx";
                public const string DESCRIPTION =
@"<variablelist>
   <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
		Indicates that the transmit audio channel has been established.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	   <para>
	   	The occurrence of <code>StartTx</code> indicates that the remote endpoint has specified the necessary information for sending an RTP stream to it.
	   </para>
	   <para>
	    	<code>StartTx</code> does not occur until either <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link> or <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link> has been used in a script.  At least one <code>StartTx</code> event should occur as a result of the successful use of <code>AnswerCall</code> or <code>MakeCall</code>.  This event can occur if the call is resumed after being placed on hold by the remote endpoint.
	   </para>  
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	If this event occurs for a call not currently in a <link linkend=""ApiGlossary.P2P"">peer-to-peer</link> relationship, then the transmit properties of the call (<code>MediaTxIP</code>, <code>MediaTxPort</code>, <code>MediaTxCodec</code>, <code>MediaTxFramesize</code>) will be automatically associated with the connection.
	    </para>
	    <para>
	    	<code>StartTx</code> will still occur for calls currently in a peer-to-peer relationship.  However, because there is no media engine connection associated with such calls, the <code>MmsId</code> and <code>ConnectionId</code> event parameters would be empty in that case.
	    </para>
	    <para>
	    	 The Call Control API makes every effort to abstract the complexities of the underlying telephony protocol; however, one should consult the <link linkend=""ApiGlossary.CallControlFeatureMatrix"">Call Control Feature Matrix</link> to understand what Call Control actions and action parameters are valid for each of the four supported protocols.  One can set installation and deployment guidelines based on the Call Control actions and action parameters that an application uses; the Call Control Feature Matrix makes developing such guidelines feasible.
	    </para>
        </listitem>
    </varlistentry>
