    public class MediaControl
    {
        public class Globals
        {
            public const string NAMESPACE = "Metreos.MediaControl";
            public const string PACKAGE_NAME = "Media Control";
            public const string PACKAGE_DESCRIPTION =
@"The Media Control API provides media streaming capabilities 
and common features associated with the manipulation of media streams, such as the following.
<itemizedlist>
    <listitem>Conferencing</listitem>
    <listitem>WAV/VOX playback</listitem>
    <listitem>Text-to-Speech</listitem>
    <listitem>Recording</listitem>
    <listitem>Transcoding</listitem>
    <listitem>Multicast Transmit</listitem>
    <listitem>Speech Recognition (via Nuance)</listitem>
</itemizedlist>

It is important to note that there is a close relationship between the <link linkend=""Metreos.CallControl"">Call Control API</link> and <link linkend=""Metreos.MediaControl"">Media Control </link> API.  The Media Control API is used automatically by the application server to 
provision media engine connections by the CUAE when using the Call Control API
to make or answer calls, unless the calls in question are <link linkend=""ApiGlossary.P2P"">peer-to-peer</link> negotiated.";
            public const string DISPLAY_NAME = "Media Engine Provider";
        }
        public class Actions
        {
            public class ReserveConnection
            {
                public const string NAME = "ReserveConnection";
                public const string FULLNAME = Globals.NAMESPACE + "." + "ReserveConnection";
               public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                Provisions a connection on a media engine without establishing the transmit RTP stream.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
                <code>ReserveConnection</code> is a means to provision a connection on the media engine without specifying transmit information to a remote endpoint.  
            </para>
            <para>
                Because the <code>ReserveConnection</code> action does not specify the transmit information, 
                the Tx RTP stream associated with this connection is not operational after the action has successfully completed.
                Therefore, <code>ReserveConnection</code> is virtually always followed by <link linkend=""Metreos.MediaControl.CreateConnection""><code>CreateConnection</code></link>, 
		which one can use to specify the transmit properties on the connection returned by <code>ReserveConnection</code>.  
		Once <code>CreateConnection</code> has been used successfully, 
		both Rx and Tx have been defined on the connection and audio is flowing between the media engine and the remote endpoint.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
                If 300 seconds elapse and <code>CreateConnection</code> has not been performed on a connection created by <code>ReserveConnection</code>,
                then the connection will be destroyed automatically by the media engine.
            </para>
	    <para>
	        For the lifetime of a connection created via <code>ReserveConnection</code>, one RTP resource is used.  If a low bitrate codec is used for this connection, then one Enhanced RTP resource is also used in conjuction with the RTP resource for the lifetime of the connection.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>
"; 
              
                public const string DISPLAY = "ReserveConnection";
                public class Params
                {
                    public class MediaRxCodec
                    {
                        public const string NAME = "MediaRxCodec";
                        public const string DISPLAY = "MediaRxCodec";
                        public const string DESCRIPTION = 
@"The codec to use for the RTP stream inbound to the media engine. Valid values are <code>G711u</code>, <code>G711a</code>, <code>G723</code>, and <code>G729</code>.
If not specified, the media engine configuration file defines the codec to use, which by default is <code>G711u</code>.";
                        public const string DEFAULT = null;
                    }
                    public class MediaTxCodec
                    {
                        public const string NAME = "MediaTxCodec";
                        public const string DISPLAY = "MediaTxCodec";
                        public const string DESCRIPTION = 
@"The codec to use for the RTP stream outbound from the media engine. Valid values are <code>G711u</code>, <code>G711a</code>, <code>G723</code>, and <code>G729</code>. 
If not specified, the media engine configuration file defines the codec to use, which by default is <code>G711u</code>.";
                        public const string DEFAULT = null;
                    }
                    public class timeout
                    {
                        public const string NAME = "timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                    public class MmsId
                    {
                        public const string NAME = "MmsId";
                        public const string DISPLAY = "MmsId";
                        public const string DESCRIPTION = "The ID of the media engine to reserve the connection on.  If no MmsId is specified when using <code>ReserveConnection</code>, a media engine with the most available resources is dynamically selected from the Media Resource Group associated with the partition of the script instance from which <code>ReserveConnection</code> is invoked.";
                        public const string DEFAULT = null;
                    }
                }
                public class Results
                {
                    public class MediaRxPort
                    {
