            public class DeleteConnection
            {
                public const string NAME = "DeleteConnection";
                public const string FULLNAME = Globals.NAMESPACE + "." + "DeleteConnection";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>DeleteConnection</code> can perform one of three distinct operations: 
		release a connection, release a conference and all connections in it, or remove a connection from a conference.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
                If releasing the resources associated with a connection, specify a valid <code>ConnectionId</code> and no <code>ConferenceId</code>.
            </para>
	    <para>
		If releasing the resources associated with a conference and releasing all the connections currently in the conference, specify a valid <code>ConferenceId</code> and no <code>ConnectionId</code>.
	    </para>
	    <para>
	    	If removing a connection from a conference, specify both a valid <code>ConnectionId</code> to be removed from a valid <code>ConferenceId</code>.
	    </para>
	    <para>
	    	If one wanted to destroy a conference but have all connections remain open and connected, then one would have to use the <code>DeleteConnection</code> action for every connection in the conference.  Each time the <code>DeleteConnection</code> action is used in such a scenario, one would need to specifying both <code>ConferenceId</code> and the <code>ConnectionId</code> being removed. 
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	<code>DeleteConnection</code> is invoked automatically be the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> by the <link linkend=""Metreos.CallControl"">Call Control</link> API
                whenever a call, previously created by <link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link> or <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link>, is <link linkend=""Metreos.CallControl.RemoteHangup"">hung up</link> or <link linkend=""Metreos.CallControl.BlindTransfer"">transferred</link> (assuming the call is not currently in a peer-to-peer call).
	    </para>
            <para>
	    	When the last connection is removed from a conference, the conference is automatically released.  The <code>ConferenceId</code> of that conference is no longer valid after that point, and does not need to be deleted with <code>DeleteConnection</code>.
            </para>
	    <para>
	    	If releasing the resources associated with a connection, then the RTP resource associated with this connection is also released.  If the connection was using low bitrate codecs, then one Enhanced RTP resource is also released.
	    </para>
