            public class SetConfereeAttribute
            {
                public const string NAME = "SetConfereeAttribute";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SetConfereeAttribute";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                Changes one or more properties of a connection in a conference.  There are a number of properties unique to a connection in a conference, which can be set as the connection is <link linkend=""Metreos.MediaControl.JoinConference"">joined</link> into the conference or when the connection is already in the conference.  <code>SetConfereeAttribute</code> is used in the case that the connection is already in a conference.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		Any connection in the conference can be muted or unmuted at anytime.  Use the <code>Mute</code> boolean to indicate whether to mute or unmute the connection in the conference.
            </para>
	    <para>
	    	Any connection in the conference can have a tone played at a regular interval, or not, by using the <code>TariffTone</code> boolean field.
	    </para>
	    <para>
	    	Coach-Pupil relationships can be created among participants in the conference by using the <code>Coach</code> and <code>Pupil</code> boolean fields.  
		There can only be one coach and pupil per conference.  A pupil can not be a coach.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	     <para>
	    	A special consideration for the <code>SetConfereeAttribute</code> is when the action is invoked on a 2-party hairpin conference (a conference that uses no conference resources).  The use of <code>Coach</code> or <code>Pupil</code> causes a 2-party hairpin conference to promote to a true conference and therefore use a conference resource per participant.  The use of <code>TariffTone</code> while the conference is a 2-party hairpin results in no promotion of the conference and no tariff tone on the connection; however, if the conference is at any time promoted to a true conference, then the tariff tone property is respected as the connection moves to conference.  The use of <code>Mute</code> takes effect immediately in a 2-party hairpin conference; there are no special considerations for <code>Mute</code>.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
		       
                public const string DISPLAY = "SetConfereeAttribute";
