            public class Play
            {
                public const string NAME = "Play";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Play";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
               Initiates playback of the specified audio file and/or plays text-to-speech to the specified connection or conference. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		The <code>Play</code> action allows one to specify up to 3 prompts, which can be either free-formed strings or the names of WAV files.  If more than one prompt is specified, the format of the supplied WAV files must all be the same (sample rate, sample size, encoding, mono, file type) and also match the format of generated TTS WAV files, which is a sample rate of 8 kHz, a sample size of 8 bit, and an audio format of PCM.  As an example, one can not specify VOX prompts in conjunction with text-to-spech prompts for a single <code>Play</code> action, since the file formats are different.
	    </para>
	    <para>
	    	The <code>Play</code> command will fire <link linkend=""Metreos.MediaControl.Play_Complete""><code>Play_Complete</code></link> once all prompts are finished, if a termination condition is satisfied, or if <code>CommandTimeout</code> is reached.  If the action fails for any reason, all prompts are cancelled and <link linkend=""Metreos.MediaControl.Play_Failed""><code>Play_Failed</code></link> is fired.
	    </para>
	    <para>
	    	The termination condition parameters on the action are a means to create a matrix of reasons that the action should cease playing.  In the <code>Play_Complete</code> event, one can use <link linkend=""Metreos.MediaControl.Play_Complete.EventParams.TerminationCondition""><code>TerminationCondition</code></link> to determine why the command stopped playing.  To see a list of all possible termination conditions, reference the <code>Play_Complete</code> <code>TerminationCondition</code> action parameter.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	   	The determination of whether a <code>Prompt</code> is a wav/vox file or a text-to-speech prompt involves a few steps.  
		<orderedlist>
			<listitem>
				If a full path is specified as the value of the <code>Prompt</code>, then the media engine will check the OS filesystem to determine if the file exists.  If the file exists, it will attempt to play the audio file to the specified connection or conference.  If the file does not exist at the specified location, then step 5 is executed.  If the a file name is specified as the value of <code>Prompt</code>, with no path information, then the next step is executed.
			</listitem>
			<listitem>
				The media engine will concat the <link linkend=""ApiGlossary.BaseAudioPath"">base audio path</link> + <link linkend=""ApiGlossary.ApplicationAudioDirectory"">application directory</link> + <link linkend=""ApiGlossary.LocaleAudioDirectory"">locale audio directory</link> + the specified <code>Prompt</code>, and check the OS filesystem to determine if the file exists. If the file exists, it will attempt to then play the audio file to the specified connection or conference. If the file does not exist, the next step is executed.
			</listitem>
			<listitem>
				The media engine will then concat the base audio path+ the specified <code>Prompt</code>, and check the OS filesystem to determine if the file exists.  If the file exists, it will attempt to then play the audio file to the specified connection or conference.  If the file does not exist, then the next step is executed.
			</listitem>
			<listitem>
				The media engine considers the <code>Prompt</code> specified as a text-to-speech prompt.  The string specified as <code>Prompt</code> will be passed to the text-to-speech engine to be converted to a WAV file.  As soon as the WAV file is generated, it is then played to the specified connection or conference.
			</listitem>
		</orderedlist>
	    </para>
	    <para>
	    	If one plays to a connection while it is in conference, the connection is temporarily taken out of the conference for the duration of the <code>Play</code>.
	    </para>
	   <para>
	   	The following properties cover most allowable audio files that can be played by the media engine:  sample rate of <code>6</code>, <code>8</code>, <code>11</code>, sample size of <code>4</code>, <code>8</code>, and <code>16</code> bit, and encoding types of <code>ulaw</code>, <code>alaw</code>, <code>pcm</code>, and <code>adpcm</code>. Only mono <code>vox</code> and <code>wav</code> files are allowed.
	    </para>
	    <para>
	    	If the command plays all prompts successfully to completion, the <code>Play</code> command will result in the <code>Play_Complete</code> event with a <code>TerminationCondition</code> of <code>eod</code>.
	    </para>
	    <para>
	    	A <code>Play</code> to a connection or a conference results in a voice resource being utilized until the action results in the <code>Play_Complete</code> event.
	    </para>
	    <para>
		If a connection is specified as the recepient of the <code>Play</code>, the voice resource attaches to the connection.  If a conference is specified as the recepient of the <code>Play</code>, a new connection (which uses a conference resource) is created and added to the conference for the duration of the <code>Play</code>, and the voice resource is attached to that new connection. It is important to understand this behavior, as the <link linkend=""Metreos.MediaControl.Play.ResultData.ConnectionId""><code>ConnectionId</code></link> result data will always be the connection to which the <code>Play</code> voice resource is attached.  In other words, in the case of a <code>Play</code> to a connection, the value of the <code>ConnectionId</code> result data is the same as that specified as an action parameter.  In the case of a <code>Play</code> to a conference, the value of the <code>ConnectionId</code> result data is the value of the <emphasis>new</emphasis> connection added to conference which is only a valid value for the duration of the <code>Play</code>.  In either case, this result data <code>ConnectionId</code> is what one would later specify in <link linkend=""Metreos.MediaControl.StopMediaOperation""><code>StopMediaOperation</code></link>.
	    </para>
	    <para>
	    	A <code>Play</code> action which specifies a text-to-speech prompt will result in the usage of a text-to-speech resource on the embedded TTS engine.  Unlike the voice resource, the text-to-speech resource is not used for the duration of the <code>Play</code> action.  Instead, the TTS resource is only used for the amount of time it takes for the embedded TTS engine to generate a wav file for the specified prompt string.  A wav file is generated in real-time at the onset of every text-to-speech <code>Play</code> operation.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
		       	
                public const string DISPLAY = "Play";
                public class Params
                {
 			public class ConnectionId
                    {
                        public const string NAME = "ConnectionId";
                        public const string DISPLAY = "ConnectionId";
                        public const string DESCRIPTION = @"The connection to perform the <code>Play</code> on.  If specified, <link linkend=""Metreos.MediaControl.Play.ActionParams.ConferenceId""><code>ConferenceId</code></link> must not be specified.";
