            public class VoiceRecognition
            {
                public const string NAME = "VoiceRecognition";
                public const string FULLNAME = Globals.NAMESPACE + "." + "VoiceRecognition";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
               	Applies 1-3 speech grammars defined on a Nuance OSR 3.01 server to the specified connection in order to detect phrases being spoken in real-time.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		The <code>VoiceRecognition</code> action allows one to detect pre-defined phrases spoken on a connection.  One can also specify WAV or VOX files to be played to the connection in conjunction with the <code>VoiceRecognition</code> command. 
	    </para>
	    <para>
	    	Once <code>VoiceRecognition</code> has successfully finished with <link linkend=""Metreos.MediaControl.VoiceRecognition_Complete""><code>VoiceRecognition_Complete</code></link>, one can then extract the top-matched meaning and confidence score from the <link linkend=""Metreos.MediaControl.VoiceRecognition_Complete.EventParams.Meaning""><code>Meaning</code></link> and <link linkend=""Metreos.MediaControl.VoiceRecognition_Complete.EventParams.Score""><code>Score</code></link> event parameters.
	    </para>
	    <para>
	    	Two action parameters are unique to <code>VoiceRecognition</code> audio streaming: <code>VoiceBargeIn</code> and <code>CancelOnDigit</code>.  <code>VoiceBargeIn</code>, if set to <code>true</code>, will cause any specified prompts to stop playing, although the voice recognition continues until completion.  <code>CancelOnDigit</code>, if set to <code>true</code>, will cause the voice recognition command to process the audio received up until the digit push and exit with <code>VoiceRecognition_Complete</code>.  The <code>Meaning</code> and <code>Score</code> event parameters are valid to use in this case.
	    </para>
	    <para>
	    	The termination condition parameters on the action are a means to create a matrix of reasons that the action should stop successfully.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	 Text-to-speech is not currently supported when playing audio with the <code>VoiceRecognition</code> command.  If one wishes to play a text-to-speech prompt in parallel with performing a <code>VoiceRecognition</code> command, one must instead use the <code>VoiceRecognition</code> (with no prompts specified) and <link linkend=""Metreos.MediaControl.Play""><code>Play</code></link> (with TTS prompts specified) actions concurrently.
	    </para>
	    <para>
	    	The grammar files specified must already have been provisioned on the Nuance OSR server before the action commences.
	    </para>
	    <para>
	   	The following properties cover most allowable audio files that can be played by the media engine:  sample rate of <code>6</code>, <code>8</code>, <code>11</code>, sample size of <code>4</code>, <code>8</code>, and <code>16</code> bit, and encoding types of <code>ulaw</code>, <code>alaw</code>, <code>pcm</code>, and <code>adpcm</code>. Only mono <code>vox</code> and <code>wav</code> files are allowed.
	    </para>
	    <para>
