            public class Record
            {
                public const string NAME = "Record";
                public const string FULLNAME = Globals.NAMESPACE + "." + "Record";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                Records audio from a connection or conference.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		The <code>Record</code> action allows one to convert the voice stream of either a single connection or an entire conference into a WAV or VOX file.   A connection can be recorded whether it is in or out of a conference. 
	    </para>
	    <para>
            	Recorded files are placed into the root of the media engine audio path, which by default is <code>C:\Program Files\Cisco Systems\Unified Application Environment\MediaServer\Audio</code>.
	    </para>
	    <para>
	    	The termination condition parameters on the action are a means to create a matrix of reasons that the action should stop successfully.  In the <link linkend=""Metreos.MediaControl.Record_Complete""><code>Record_Complete</code></link> event, one can use <link linkend=""Metreos.MediaControl.Record_Complete.EventParams.TerminationCondition""><code>TerminationCondition</code></link> to determine why the command stopped recording. 
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	The <code>Record</code> action will analyze the <code>Filename</code> action parameter (if specified) to determine if it is a full path. If it is a full path and assuming the path does indeed exist on the OS filesystem, the <code>Record</code> action will place the recording there.  Note that when a full path is specified, the media engine will not automatically expire the file, regardless of the value of the <code>Expires</code> parameter.  If the filename is simply a file name (no path), or if it is not specified and the name is generated by the media engine automatically, then the media engine will concat the <link linkend=""ApiGlossary.BaseAudioPath"">base audio path</link> and the filename; the <code>Record</code> action will place the recording in this location. 
	    </para>
	    <para>
	   	The following properties cover most allowable audio file formats that can be recorded by the media engine:  sample rate of <code>6</code>, <code>8</code>, <code>11</code>, sample size of <code>4</code>, <code>8</code>, and <code>16</code> bit, and encoding types of <code>ulaw</code>, <code>alaw</code>, <code>pcm</code>, and <code>adpcm</code>. Only mono <code>vox</code> and <code>wav</code> files are allowed.
	    </para>
	    <para>
	    	A <code>Record</code> to a connection or a conference results in a voice resource being utilized until the action results in <code>Record_Complete</code> event. 
	    </para>
	    <para>
	       	If a connection is specified as the recepient of the <code>Record</code>, the voice resource attaches to the connection.  If a conference is specified as the recepient of the <code>Record</code>, a new connection (which uses a conference resource) is created and added to the conference for the duration of the <code>Record</code>, and the voice resource is attached to that new connection. It is important to understand this behavior, as the <link linkend=""Metreos.MediaControl.Record.ResultData.ConnectionId""><code>ConnectionId</code></link> result data will always be the connection to which the <code>Record</code> voice resource is attached.  In other words, in the case of a <code>Record</code> to a connection, the value of the <code>ConnectionId</code> result data is the same as that specified as an action parameter.  In the case of a <code>Record</code> to a conference, the value of the <code>ConnectionId</code> result data is the value of the new connection added to conference which is only a valid value for the duration of the <code>Record</code>.  In either case, this result data <code>ConnectionId</code> is what one would later specify in <link linkend=""Metreos.MediaControl.StopMediaOperation""><code>StopMediaOperation</code></link>.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
