                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	    	<code>StopMediaOperation</code> has two distinct modes.  It can be used to stop the specific command identified by <code>OperationId</code>, or it can be used to stop all commands executing on a connection.
