            public class CreateConference
            {
                public const string NAME = "CreateConference";
                public const string FULLNAME = Globals.NAMESPACE + "." + "CreateConference";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	    	Creates a conference and places the specified connection into it as the 1st participant.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		A conference can not be created with zero connections; there must be one connection in the conference to start.
	    </para>
	    <para>
	    	A conference is uniquely identified by the <code>ConferenceId</code> result data parameter returned by <code>CreateConference</code>.
	    </para>
	    <para>
		In most cases, <code>Hairpin</code> should be set to <code>true</code> (the default) to use the minimum amount of audio resources for a 2-party conference.  Specifically, a hairpinned conference does not use any conference resources.  However, a hairpin conference will be 'promoted', or converted to a true media conference, if a 3rd participant is added to the conference or if a voice operation is performed on the conference itself.  In either case, this will cause each participant and conferenced voice operation to use one conference resource.  True conferences also have a slightly increased latency over a hairpinned conference.
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
		All connections in the conference must be fully connected (Tx and Rx conditions both established on the connection; <link linkend=""Metreos.MediaControl.CreateConnection""><code>CreateConnection</code></link> and certain 
		actions in the <link linkend=""Metreos.CallControl"">Call Control</link> API are used to accomplish this.  For convenience, a <code>ConnectionId</code> returned from a <link linkend=""Metreos.MediaControl.ReserveConnection""><code>ReserveConnection</code></link> can be specified along with the <code>MediaTxIP</code>, <code>MediaTxPort</code> and <code>MediaTxCodec</code> parameters, in which case a <code>CreateConnection</code> does not have to be performed explicitly by the develeoper, since the media engine will automatically fully establish the Tx RTP properties the <code>ConnectionId</code> as the connection is joined to conference.
	    </para>
	    <para>
		<code>Mute</code> and <code>Monitor</code> have a similar effect to one another; the participant specified by <code>ConnectionId</code> can only hear audio and is unable to send audio to the conference.  The difference is that each <code>Mute</code> participant is truly in the conference, and so uses a conference resource; at anytime this participant can be allowed to send audio seamlessly via the use of the <link linkend=""Metreos.MediaControl.SetConfereeAttribute""><code>SetConfereeAttribute</code></link> <link linkend=""Metreos.MediaControl.SetConfereeAttribute.ActionParams.Mute""><code>Mute</code></link> parameter. <code>Monitor</code> participants are not truly in the conference from an internal logic standpoint, and can only transmit audio into the conference by removing their connection from conference, and placing back in with <code>Monitor</code> set to <code>false</code>.  One also saves resources by using <code>Monitor</code> over <code>Mute</code> for many participants.  Each <code>Monitor</code> participant shares one conference resource, but <code>Mute</code> participants each need a conference resource.
	    </para>
	    <para>
	    	<link linkend=""Metreos.CallControl.AnswerCall""><code>AnswerCall</code></link> and <link linkend=""Metreos.CallControl.MakeCall""><code>MakeCall</code></link> both automatically invoke <code>CreateConference</code> or <link linkend=""Metreos.MediaControl.JoinConference""><code>JoinConference</code></link> if the <code>AnswerCall</code> <link linkend=""Metreos.CallControl.AnswerCall.ActionParams.Conference""><code>Conference</code></link> action parameter or <code>MakeCall</code> <link linkend=""Metreos.CallControl.MakeCall.ActionParams.Conference""><code>Conference</code></link> action parameter is set to <code>true</code>.
	    </para>
	    <para>
	    	Each connection in a conference uses one conference resource.  Because this action places one connection into the conference, one conference resource is utilized once this action has succeeded.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
		
                public const string DISPLAY = "CreateConference";
                public class Params
                {
                    public class Pupil
                    {
                        public const string NAME = "Pupil";
                        public const string DISPLAY = "Pupil";
                        public const string DESCRIPTION = 
@"Indicates whether this connection can hear audio originating from the coach.";
                        public const string DEFAULT = null;
                    }
                    public class ReceiveOnly
                    {
                        public const string NAME = "ReceiveOnly";
                        public const string DISPLAY = "Mute";
                        public const string DESCRIPTION = 
@"The specified connection can hear others in the conference, but can not transmit back to the conference.";
                        public const string DEFAULT = null;
                    }
                    public class SoundToneOnJoin
                    {
                        public const string NAME = "SoundToneOnJoin";
                        public const string DISPLAY = "SoundToneOnJoin";
                        public const string DESCRIPTION =
@"Indicates whether a tone is played when each participant joins the conference.";
                        public const string DEFAULT = null;
                    }
                    public class CallId
                    {
                        public const string NAME = "CallId";
                        public const string DISPLAY = "CallId";
                        public const string DESCRIPTION = 
@"The ID of the call associated with this connection (hairpin only).";
                        public const string DEFAULT = null;
                    }
                    public class timeout
                    {
                        public const string NAME = "timeout";
