                    {
                        public const string NAME = "ConnectionId";
                        public const string DISPLAY = "ConnectionId";
                        public const string DESCRIPTION = 
"Indicates the connection to add to the new conference as the 1st participant on.  If <code>MmsId</code> is specified, this <code>ConnectionId</code> must reside on the same media engine.";
                        public const string DEFAULT = null;
                    }
                    public class MediaRxCodec
                    {
                        public const string NAME = "MediaRxCodec";
                        public const string DISPLAY = "MediaRxCodec";
                        public const string DESCRIPTION = 
@"The codec to use for the RTP stream inbound to the media engine. Valid values are <code>G711u</code>, <code>G711a</code>, <code>G723</code>, and <code>G729</code>. 
If not specified, the <code>MediaRxCodec</code> already defined for the connection is respected.";
                        public const string DEFAULT = null;
                    }
                    public class MediaRxFramesize
                    {
                        public const string NAME = "MediaRxFramesize";
                        public const string DISPLAY = "MediaRxFramesize";
                        public const string DESCRIPTION = 
@"The framesize (in milliseconds) to use for the RTP stream inbound to the media engine.
If not specified, the <code>MediaRxFramesize</code> already defined for the connection is respected.";
                        public const string DEFAULT = null;
                    }
                    public class MediaTxIP
                    {
                        public const string NAME = "MediaTxIP";
                        public const string DISPLAY = "MediaTxIP";
                        public const string DESCRIPTION =
@"The IP address that the Tx RTP stream will transmit audio to. 
This must be specified if the <code>ConnectionId</code> specified was created by a <code>ReserveConnection</code>
and has not yet had its Tx properties set with <code>CreateConnection</code>.";
                        public const string DEFAULT = null;
                    }
                    public class MediaTxPort
