                        public const string DISPLAY = "MediaTxPort";
                        public const string DESCRIPTION =
@"The port that the Tx RTP stream will transmit audio to. 
This must be specified if the <code>ConnectionId</code> specified was created by a <code>ReserveConnection</code>
and has not yet had its transmit properties set with <code>CreateConnection</code>.";
                        public const string DEFAULT = null;
                    }
                    public class MmsId
                    {
                        public const string NAME = "MmsId";
                        public const string DISPLAY = "MmsId";
                        public const string DESCRIPTION = 
@"Unique identifier used to identify the media engine in control of this conferences.  
A common use for this ID is to ensure that other connections which will ultimately be conferenced with this connection are all created on the same media engine.  
This correlation is necessary because all connections in a single conference must all reside on the same media engine.";
                        public const string DEFAULT = null;
                    }
