                    {
                        public const string NAME = "MediaTxControlPort";
                        public const string DISPLAY = "MediaTxControlPort";
                        public const string DESCRIPTION = "The RTCP port of the remote endpoint.";
                        public const string DEFAULT = null;
                    }
                    public class MediaTxCodec
                    {
                        public const string NAME = "MediaTxCodec";
                        public const string DISPLAY = "MediaTxCodec";
                        public const string DESCRIPTION = 
@"The codec to use for the RTP stream outbound from the media engine. Valid values are <code>G711u</code>, <code>G711a</code>, <code>G723</code>, and <code>G729</code>. 
If not specified and if the connection has not yet had its transmit properties set with <code>CreateConnection</code>, the media engine configuration file defines the codec to use, which by default is <code>G711u</code>. If not specified and the connection has had its transmit properties set, the <code>MediaTxCodec</code> already defined for the connection is respected.";
                        public const string DEFAULT = null;
                    }
                    public class MediaTxFramesize
                    {
                        public const string NAME = "MediaTxFramesize";
                        public const string DISPLAY = "MediaTxFramesize";
                        public const string DESCRIPTION = 
@"The framesize (in milliseconds) to use for the RTP stream outbound from the media engine.  
If not specified and if the connection has not yet had its transmit properties set with <code>CreateConnection</code>, the media engine configuration file defines the framesize to use, which by default is 20ms. If not specified and the connection has had its transmit properties set, the <code>MediaTxCodec</code> already defined for the connection is respected.";
                        public const string DEFAULT = null;
                    }
                    public class Hairpin
                    {
                        public const string NAME = "Hairpin";
                        public const string DISPLAY = "Hairpin";
                        public const string DESCRIPTION = 
@"Indicates that the new conference should be optimized for two parties.  A hairpinned conference does not use any conference resources.  However, a hairpin conference will be 'promoted', or converted to a true media conference, if a 3rd participant is added to the conference or if a voice operation is performed on the conference itself.  In either case, this will cause each participant and conferenced voice operation to use one conference resource.  True conferences also have a slightly increased latency over a hairpinned conference.";
                        public const string DEFAULT = null;
                    }
