            public class GatherDigits
            {
                public const string NAME = "GatherDigits";
                public const string FULLNAME = Globals.NAMESPACE + "." + "GatherDigits";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
	     	<code>GatherDigits</code> instructs the media engine to watch for DTMF digits on a connection.  
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
		<code>GatherDigits</code> allows one to determine which digits were pushed.
	    </para>
 	    <para>
	    	The termination condition parameters on the action are a means to create a matrix of reasons that the action should stop successfully.  
		In the <link linkend=""Metreos.MediaControl.GatherDigits_Complete""><code>GatherDigits_Complete</code></link> event, 
		one can use <link linkend=""Metreos.MediaControl.GatherDigits_Complete.EventParams.TerminationCondition""><code>TerminationCondition</code></link> 
		to determine why the command stopped gathering digits. 
	    </para>
        </listitem>
    </varlistentry>
	<varlistentry>
        <term>Remarks</term>
        <listitem>
	     <para>
	     	The media engine is continuously buffering observed digits for any given connection.  
		<code>GatherDigits</code> considers any digits stored in this digit buffer at the onset of the action for the processing of any specified termination conditions.  Once the <code>GatherDigits</code> action has started executing, digits that occur in real-time also fill up the buffer and so can cause the specified termination conditions to be met.  For example, if the user pushes <code>123</code>, and then a <code>GatherDigits</code> operation is executed with a <code>TermCondDigitPattern</code> of <code>1234</code> specified, the <code>GatherDigits_Complete</code> event will occur as soon as the user pushes <code>4</code>.  After the <code>GatherDigits_Complete</code> event is fired, the buffer is cleared of all digits.
            </para>
	    <para>
	    	A <code>GatherDigits</code> to a connection or a conference results in a voice resource being utilized until the action results in the <code>GatherDigits_Complete</code> event.
	    </para>
	    <para>
	      	If a connection is specified as the recepient of the <code>GatherDigits</code>, the voice resource attaches to the connection.  If a conference is specified as the recepient of the <code>GatherDigits</code>, a new connection (which uses a conference resource) is created and added to the conference for the duration of the <code>GatherDigits</code>, and the voice resource is attached to that new connection. It is important to understand this behavior, as the <link linkend=""Metreos.MediaControl.GatherDigits_Complete.EventParams.ConnectionId""><code>ConnectionId</code></link> result data will always be the connection to which the <code>GatherDigits</code> voice resource is attached.  In other words, in the case of a <code>GatherDigits</code> to a connection, the value of the <code>ConnectionId</code> result data is the same as that specified as an action parameter.  In the case of a <code>GatherDigits</code> to a conference, the value of the <code>ConnectionId</code> result data is the value of the new connection added to conference which is only a valid value for the duration of the <code>GatherDigits</code>.  In either case, this result data <code>ConnectionId</code> is what one would later specify in <link linkend=""Metreos.MediaControl.StopMediaOperation""><code>StopMediaOperation</code></link>.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "GatherDigits";
                public class Params
                {

		    public class ConnectionId
                    {
                        public const string NAME = "ConnectionId";
                        public const string DISPLAY = "ConnectionId";
                        public const string DESCRIPTION = "Indicates the connection to <code>GatherDigits</code> on.";
                        public const string DEFAULT = null;
                    }
                    public class TermCondDigitList
                    {
                        public const string NAME = "TermCondDigitList";
