                        public const string DESCRIPTION = 
@"A list of digits that will cause the <code>GatherDigits</code> operation to terminate, if any one of the digits in the list is inputted.  The list has no delimiters.  
If this condition is met, the <code>GatherDigits</code> command will result in the <code>GatherDigits_Complete</code> event with a <code>TerminationCondition</code> of <code>digitlist</code>.";
                        public const string DEFAULT = null;
                    }
                    public class TermCondMaxTime
                    {
                        public const string NAME = "TermCondMaxTime";
                        public const string DISPLAY = "TermCondMaxTime";
                        public const string DESCRIPTION =
@"The amount of time (in milliseconds) that can elapse before terminating the <code>GatherDigits</code> operation.  
If this condition is met, the <code>GatherDigits</code> command will result in the <code>GatherDigits_Complete</code> event with a <code>TerminationCondition</code> of <code>maxtime</code>.";
                        public const string DEFAULT = null;
                    }
                    public class TermCondMaxDigits
                    {
                        public const string NAME = "TermCondMaxDigits";
                        public const string DISPLAY = "TermCondMaxDigits";
                        public const string DESCRIPTION = 
@"The number of digits that will cause the <code>GatherDigits</code> operation to terminate.  
If this condition is met, the <code>GatherDigits</code> command will result in the <code>GatherDigits_Complete</code> event with a <code>TerminationCondition</code> of <code>maxdigits</code>.";
                        public const string DEFAULT = null;
                    }
