                        public const string DESCRIPTION = 
@"A specific digit that will cause the <code>GatherDigits</code> operation to terminate.  
If this condition is met, the <code>GatherDigits</code> command will result in the <code>GatherDigits_Complete</code> event with a <code>TerminationCondition</code> of <code>digit</code>.";
                        public const string DEFAULT = null;
                    }
                    
                    public class TermCondDigitPattern
                    {
                        public const string NAME = "TermCondDigitPattern";
                        public const string DISPLAY = "TermCondDigitPattern";
                        public const string DESCRIPTION =
@"A specific sequence of digits that will cause the <code>GatherDigits</code> operation to terminate.  
If this condition is met, the <code>GatherDigits</code> command will result in the <code>GatherDigits_Complete</code> event with a <code>TerminationCondition</code> of <code>digitpattern</code>.";
