    public class CiscoIpPhone
    {
        public class Globals
        {
            public const string NAMESPACE = "Metreos.Native.CiscoIpPhone";
            public const string PACKAGE_NAME = "Metreos.Native.CiscoIpPhone";
            public const string PACKAGE_DESCRIPTION = 
@"The Cisco IP Phone API allows developers to easily and quickly create IP Phone XML objects.  One can use this API to create textual displays, menus, directories, images and the other XML-based features that the Cisco IP Phone supports.  Note that while this API simplifies interaction with the Cisco IP Phone phones, you must still read the developer documentation available on the Cisco IP Phone XML objects in order to use this API successfully.";
        }
        public class Actions
        {
            public class CreateGraphicMenu
            {
                public const string NAME = "CreateGraphicMenu";
                public const string FULLNAME = Globals.NAMESPACE + "." + "CreateGraphicMenu";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>CreateGraphicMenu</code> initializes a <link linkend=""Metreos.Types.CiscoIpPhone.GraphicMenu""><code>GraphicMenu</code></link> XML object, which one can later use to display a graphical menu on a Cisco IP Phone, in which the number keys on the Cisco IP phone can be used to trigger phone activity.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
