@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>AddMenuItem</code> adds a menu item to an already-initialized <link linkend=""Metreos.Types.CiscoIpPhone.Menu""><code>Menu</code></link>, <link linkend=""Metreos.Types.CiscoIpPhone.IconMenu""><code>IconMenu</code></link>, <link linkend=""Metreos.Types.CiscoIpPhone.GraphicMenu""><code>GraphicMenu</code></link>, or <link linkend=""Metreos.Types.CiscoIpPhone.GraphicFileMenu""><code>GraphicFileMenu</code></link> XML object.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
               <code>AddMenuItem</code> is a multi-purpose action which is used in different ways based on which XML object type it is being used to augment.  The reason is that a MenuItem has different meaning depending on which context, and more specifically, which XML object it is being used on.  The following is a list of which action parameters are of interest based on which XML object is being augmented with <code>AddMenuItem</code>.:
	       <itemizedlist>
	       		<listitem>
				<code>Menu</code> XML objects respect the <code>Name</code> and <code>URL</code> action parameters.
			</listitem>
			<listitem>
				<code>IconMenu</code> XML objects respect the <code>Name</code>, <code>URL</code>, and <code>IconIndex</code> action parameters.
			</listitem>
			<listitem>
				<code>GraphicMenu</code> XML objects respect the <code>Name</code> and <code>URL</code> action parameters.
			</listitem>
			<listitem>
				<code>GraphicFileMenu</code> XML objects respect the <code>Name</code>, <code>URL</code>, <code>TouchAreaX1</code>, <code>TouchAreaX2</code>, <code>TouchAreaY1</code>, and <code>TouchAreaY2</code> action parameters.
			</listitem>
	       </itemizedlist>
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
                This action does not communicate with a Cisco IP Phone; it only formats XML specific to the schema defined by the Cisco IP Phones that support Cisco IP Phone XML Services.  Later in the script the XML object stored in a variable can be sent to the phone with either <link linkend=""Metreos.Providers.Http.SendResponse""><code>SendResponse</code></link> or <link linkend=""Metreos.Native.CiscoIpPhone.SendExecute""><code>SendExecute</code></link>.
