@"An index into the list of icon items to indicate which icon should be shown next to this menu item.  This field is valid only when used with a <code>IconMenu</code> XML object.";
                        public const string DEFAULT = null;
                    }
                    public class Name
                    {
                        public const string NAME = "Name";
                        public const string DISPLAY = "Name";
                        public const string DESCRIPTION = 
@"The name of the menu item.  This field is displayed with a menu or an icon menu XML object.  With a graphic menu or graphic file menu, it is used as the title of the subsequent XML screen if the item is selected and if the subsequent screen does not specify a title.  This field is valid with <code>Menu</code>, <code>IconMenu</code>, <code>GraphicMenu</code>, and <code>GraphicFileMenu</code>.";
