            public class SendExecute
            {
                public const string NAME = "SendExecute";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SendExecute";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>SendExecute</code> sends an XML object directly to the Cisco IP Phone using an HTTP POST.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
               <code>SendExecute</code> can send two distinctly different commands to the Cisco IP Phone. One is the <link linkend=""Metreos.Types.CiscoIpPhone.Execute""><code>Execute</code></link> XML object, which is used to cause the phone to execute internal commands, such as <code>RTPRx</code> or <code>Dial</code>, or to cause the phone to fetch IP Phone XML from an HTTP server.  <code>SendExecute</code> can also used to send content-based XML objects, such as a <link linkend=""Metreos.Types.CiscoIpPhone.Text""><code>Text</code></link> or <link linkend=""Metreos.Types.CiscoIpPhone.Menu""><code>Menu</code></link> XML object.
            </para>
	    <para>
	    	The Cisco IP Phones have an important limitation in that one can only push <code>512</code> bytes of content to the phone.  This effectively means that pushing a <code>Execute</code> XML object to a phone is the more robust way to have the phone render large amounts of data, because the phone can be pushed an HTTP-based URL which the phone will subsequently request XML from, circumventing the <code>512</code> byte 'push' limitation.  There is no <code>512</code> byte limitation when the phone makes a request to a HTTP-based URL.
	    </para>
	    <para>
	    	The <code>SendExecute</code> requires an IP address to send the XML command to using an HTTP POST.  However, it is a common problem to not have the IP address of a Cisco IP phone readily available, although often one has the device name (of the form SEPXXXXXXXXXXXX) of the phone. One can use the <link linkend=""Metreos.Native.CiscoDeviceList""><code>Cisco DeviceListX</code></link> cache to determine IP address of a Cisco IP Phone based on this device name.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
                This action communicates directly with the Cisco IP Phone using an HTTP post originating from the application server.
    	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "SendExecute";
                public class Params
                {
                    public class Message
                    {
                        public const string NAME = "Message";
                        public const string DISPLAY = "Message";
                        public const string DESCRIPTION = 
@"The XML object to be sent to the Cisco IP Phone.  
The XML object can be one of the following types:
<itemizedlist>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Execute""><code>Execute</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Text""><code>Text</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Menu""><code>Menu</code></link>	
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Directory""><code>Directory</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Image""><code>Image</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.ImageFile""><code>ImageFile</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Input""><code>Input</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.IconMenu""><code>IconMenu</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.GraphicMenu""><code>GraphicMenu</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.GraphicFileMenu""><code>GraphicFileMenu</code></link>
	</listitem>
	<listitem>
		<link linkend=""Metreos.Types.CiscoIpPhone.Status""><code>Status</code></link>
	</listitem>
</itemizedlist>
Note that the variable should not be passed directly into this action parameter.  Instead, use c# to invoke the <code>ToString()</code> method invoked on the XML object variable; for instance, <code>myXmlVar.ToString()</code>.  Also, with any content-based XML object (all types aside from <code>Execute</code>), the <code>512</code> byte limit will limit the practical usage of dynamic content in these types when pushed with <code>SendExecute</code>.  If you have a variable amount of content to show, then use <code>Execute</code> to pass an HTTP-based URL to the phone to have it fetch the content XML object instead, thereby circumventing the <code>512</code> byte limit.";
                        public const string DEFAULT = null;
                    }
                    public class URL
                    {
                        public const string NAME = "URL";
                        public const string DISPLAY = "PhoneIP";
                        public const string DESCRIPTION = 
