            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
              	<code>AddInputItem</code> allows the developer to define the properties of a user-accessible prompt that will be added to a Cisco IP Phone Input XML object.  This input item is stored into the <code>Input</code> XML type that was previously initialized with the <link linkend=""Metreos.Native.CiscoIpPhone.CreateInput""><code>CreateInput</code></link> action. 
	    </para>
	    <para>
	    	It is important to understand the interaction between the <code>URL</code> action parameter specified in <code>CreateInput</code> and the <link linkend=""Metreos.Native.CiscoIpPhone.AddInputItem.ActionParams.QueryStringParam""><code>QueryStringParam</code></link> action parameter in the <code>AddInputItem</code> action.  The <code>URL</code> action parameter in <code>CreateInput</code> defines the base URL.  Each <code>QueryStringParam</code> of any input items are appended to the base URL as a query parameter, with the value of the text entered by the user defined as the value of the query parameter.  For example, assume we specified a <code>URL</code> of <code>http://appserver:8000/myscript</code> and a <code>QueryStringParam</code> with a value of <code>userid</code>, and also assume the user enters the value <code>bob</code> on the phone for that input item.  When the user hits the <code>Submit</code> softkey on the Cisco IP Phone, the phone will generate a request to the URI <code>http://appserver:8000/myscript?userid=bob</code>.
    	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
                This action does not communicate with a Cisco IP Phone; it only formats XML specific to the schema defined by the Cisco IP Phones that support Cisco IP Phone XML Services.  Later in the script the XML object stored in a variable can be sent to the phone with either <link linkend=""Metreos.Providers.Http.SendResponse""><code>SendResponse</code></link> or <link linkend=""Metreos.Native.CiscoIpPhone.SendExecute""><code>SendExecute</code></link>.
    	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
