            public class QueryParamCollection
            {
                public const string NAME = "QueryParamCollection";
                public const string FULLNAME = Globals.NAMESPACE + "." + "QueryParamCollection";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
		The <code>QueryParamCollection</code> allows developers easy access to the name-value pairs contained in the query portion of a URI.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
      		<code>QueryParamCollection</code> provides a number of utilities to help developers quickly access the names and corresponding values of the query portion in a URI.  With this type, one can either determine the value of a query parameter, given a well-known query parameter name, or programmatically iterate through all, passed-in query parameters if the name of a particular query parameter is not known at design-time.
            </para>
	    <para>
	    	To initialize a <code>QueryParamCollection</code> variable with the query parameters from an incoming <link linkend=""Metreos.Providers.Http.GotRequest""><code>GotRequest</code></link> event, set the <link linkend=""ApiGlossary.LocalInitializeWith""><code>InitializeWith</code></link> property of a variable in the event handler to the event parameter <link linkend=""Metreos.Providers.Http.GotRequest.EventParams.query""><code>Query</code></link>. 
	    </para>
	    <para>
	    	To read a query parameter in from the <code>QueryParamCollection</code> type, use the .NET indexer syntax on the variable, specifying the name of the query parameter as the argument to the indexer.  For example, if one had a variable of the name <code>queryParams</code>, and wanted to know the value of a query parameter called 'user', then the C# snippet <code>queryParams[""user""]</code> would resolve to that value.
	    </para>
	    <para>
	    	To programmatically determine all the query parameters passed in, three members defined by <code>QueryParamCollection</code> in particular are of interest.  One is the <code>Count</code> property, which will indicate how many query parameters are defined in total.  Using that as a loop count, one can then use the <code>GetNameAt( System.Int32 )</code> method and <code>this[ System.Int32 ]</code> indexer to determine the name and value of each query parameter defined in the request.  For example, one can build a <link linkend=""ApiGlossary.CustomCode"">CustomCode</link> action that takes a variable named <code>queryParams</code> as an argument, and iterates over every query parameter like the below example:
<example id=""Metreos.Types.Http.QueryParamCollection.Usage1"">
<title>Dynamically Determining Contents of the QueryParamCollection</title>
<programlisting linenumbering=""true"" width=""80"">
<![CDATA[
public static string Execute(Metreos.Types.Http.QueryParamCollection queryParams)
{
    for(int i = 0; i < queryParams.Count; i++)
    {
        string queryParamName = queryParams.GetNameAt(i);

        string queryParamValue = queryParams[i];

        //perform logic...
    }

    return String.Empty;
}
]]>
</programlisting>
</example>
	    </para>
