    public class Http
    {
        public class Globals
        {
            public const string NAMESPACE = "Metreos.Providers.Http";
            public const string PACKAGE_NAME = "Metreos.Providers.Http";
            public const string PACKAGE_DESCRIPTION =
@"The HTTP Provider implements HTTP server capabilities for use by applications.  This server functionality can be used with Cisco IP Phones, web browsers, or web client libraries found in other development environments.";
            public const string DISPLAY_NAME = "HTTP Provider";
        }
        public class Actions
        {
            public class SendResponse
            {
                public const string NAME = "SendResponse";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SendResponse";
                public const string DESCRIPTION = 
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>SendResponse</code> will send an HTTP response to a pending HTTP request. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	    	In practical use, the <code>SendResponse</code> action is coupled with every occurrence of the <link linkend=""Metreos.Providers.Http.GotRequest""><code>GotRequest</code></link> event, which is the event that corresponds to a pending HTTP request.  The <link linkend=""Metreos.Providers.Http.SendResponse.ActionParams.remoteHost""><code>RemoteHost</code></link> action parameter of SendResponse should always the same value as the <code>RemoteHost</code> event parameter of the <code>GotRequest</code> event in order for the response to be sent back to the correct request.
	    </para>
	    <para>
	    	If one is sending back Cisco IP Phone XML as the <code>Body</code> of the response, note that the Cisco IP Phone XML variable must be passed in as a <code>C#</code> parameter, and the variable must have the <code>ToString()</code> method invoked on it, for instance, <code>myXmlVar.ToString()</code>.  The Cisco IP Phone XML variable can not be passed in directly to the <code>Body</code> action parameter; it must be converted to a string before it is sent to the HTTP Provider.  Also, be sure to set the <code>Content-Type</code> variable to the value <code>text/xml</code> if you are communicating with a Cisco IP Phone.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
	    <para>
	    	One can specify custom action parameters for this action.  Any custom action parameter is converted to a header in the HTTP response.  For example, with this mechanism, one can send back a cookie by specifying a custom action parameter with the name <code>Set-Cookie</code> and the appropriate, cookie-formatted value.
	    </para>
	    <para>
	    	Many web development environments allow one to specify a numeric value for the <code>Expires</code> header, which is treated as an offset in minutes of the current time. The HTTP Provider does not support this simple, numeric notion.  The value of the <code>Expires</code> header is passed through directly to the HTTP response, requiring the developer to format the <code>Expires</code> header in conformance with the HTTP specification.  One can use the <ulink url=""http://msdn2.microsoft.com/en-us/library/system.datetime.aspx""><code>System.DateTime</code></ulink> class to generate this properly formatted string.  For instance, a value for the <code>Expires</code> header that would indicate to the web client that the page is expired already could be <code>DateTime.MinValue.ToUniversalTime().ToString(""r"")</code>.
	    </para>
	    <para>
	    	One must use the <code>SendResponse</code> action within <code>5</code> minutes of receiving <code>GotRequest</code>; otherwise, the HTTP provider will send back a response automatically to the client with a response code of <code>404</code> and the script will have lost its opportunity to respond to the request.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "SendResponse";
                public class Params
                {
                    public class timeout
                    {
                        public const string NAME = "timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                    public class remoteHost
                    {
                        public const string NAME = "remoteHost";
                        public const string DISPLAY = "RemoteHost";
                        public const string DESCRIPTION = 
@"The IP address and port of the remote client, of the form IP:PORT.  This correct value for this field is obtainable from the <code>RemoteHost</code> event parameter from the <code>GotRequest</code> event.";
                        public const string DEFAULT = null;
                    }
                    public class responseCode
                    {
                        public const string NAME = "responseCode";
                        public const string DISPLAY = "ResponseCode";
                        public const string DESCRIPTION = 
@"The numeric code of the HTTP response, such as <code>200</code> for <code>OK</code> or <code>404</code> for <code>Not Found</code>.";
                        public const string DEFAULT = null;
                    }
                    public class responsePhrase
                    {
                        public const string NAME = "responsePhrase";
                        public const string DISPLAY = "ResponsePhrase";
                        public const string DESCRIPTION = 
@"The response phrase of the HTTP response which corresponds to the <code>ResponseCode</code>, such as <code>OK</code> for <code>200</code> or <code>Not Found</code> for <code>404</code>.";
                        public const string DEFAULT = null;
                    }
                    public class body
                    {
                        public const string NAME = "body";
                        public const string DISPLAY = "Body";
                        public const string DESCRIPTION = 
@"The content of the response.";
                        public const string DEFAULT = null;
                    }
                    public class Content_Type
                    {
                        public const string NAME = "Content-Type";
                        public const string DISPLAY = "Content-Type";
                        public const string DESCRIPTION = 
@"<code>Content-Type</code> describes the format of the <code>Body</code>, such as <code>text/xml</code> or <code>text/html</code>.";	
                        public const string DEFAULT = null;
                    }
                }
            }
            public class SessionEnd
            {
                public const string NAME = "SessionEnd";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SessionEnd";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>SessionEnd</code> is used to indicate to the HTTP Provider that this HTTP session is no longer active.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
	    <para>
	    	The HTTP Provider offers basic session-keeping features for applications.  The HTTP Provider will correlate inbound HTTP requests with a running script if a <link linkend=""ApiGlossary.RoutingGuid""><code>RoutingGuid</code></link> is present in either a header, cookie, or query parameter named <code>metreosSessionId</code>.  Also, the HTTP Provider will fire a <link linkend=""Metreos.Providers.Http.SessionExpired""><code>SessionExpired</code></link> event if it determines that a particular session has become inactive.  The <code>SessionEnd</code> action gives the developer a way to indicate to the provider to no longer maintain the latter session service, the firing of <code>SessionExpired</code>.  The liberal and judicious use of this action improves the overall scalability and efficiency of the HTTP provider.
	    </para>
	    <para>
	    	One way to easily and effectively call <code>SessionEnd</code> is to use it in the <link linkend=""Metreos.ApplicationControl.InstanceDestruction""><code>InstanceDestruction</code></link> event handler.
    	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
               None.
            </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "SessionEnd";
                public class Params
                {
                    public class timeout
                    {
                        public const string NAME = "timeout";
                        public const string DISPLAY = "Timeout";
                        public const string DESCRIPTION = "The <code>Timeout</code> property specifies to the <code>Application Runtime Environment</code>  how long to wait for a response from the provider for the current action.  The ReturnValue returned in this case is 'Timeout'. The value must be a literal value in milliseconds.";
                        public const string DEFAULT = null;
                    }
                }
            }
        }
        public class Events
        {
            public class GotRequest
            {
                public const string NAME = "GotRequest";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>GotRequest</code> is fired whenever an HTTP request sent to the application server is routed to a script.
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem>
            <para>
               The <code>GotRequest</code> event allows one to build scripts with HTTP server capabilities for any well-formed HTTP client, such as modern web browsers, Cisco IP phones, and HTTP client libraries in development environments.  The script which receives the HTTP request should in general be sure to respond to the request with the <link linkend=""Metreos.Providers.Http.SendResponse""><code>SendResponse</code></link> action.
            </para>
	    <para>
			The <code>GotRequest</code> event can be either a <link linkend=""ApiGlossary.TriggeringEvent""><code>triggering event</code></link> or a <link linkend=""ApiGlossary.NonTriggeringEvent""><code>non-triggering event</code></link>, meaning an HTTP request can either cause a script to initiate and begin executing, or an HTTP request can route to an already-running script.  
	    </para>
	    <para>
	    	The determination if an incoming HTTP request should be treated as a <code>triggering event</code> or a <code>non-triggering event</code> is based on the presence of session information in the request.  Specifically, the following describes how HTTP requests are processed by the HTTP provider:
		<orderedlist>
			<listitem>
				If the HTTP request contains no session information, the HTTP request is sent up to the <link linkend=""ApiGlossary.ARE""><code>Application Runtime Environment</code></link> as a <code>triggering event</code>, at which point:
			       	<itemizedlist>
					<listitem>
						If the <link linkend=""ApiGlossary.EventSignature""><code>event signature</code></link> of the request matches the <link linkend=""ApiGlossary.EventFilterCriteria""><code>event filter criteria</code></link> of an enabled script, that script will initiate and begin executing.
					</listitem>
					<listitem>
						Otherwise if no enabled script's <code>event filter criteria</code> matches the <code>event signature</code> of the incoming request, the <code>GotRequest</code> is <link linkend=""ApiGlossary.NoHandler"">not handled</link>, and the HTTP provider will then send a <code>404</code> response to the client, because no script is available to process the request.
					</listitem>
				</itemizedlist>
			</listitem>
			<listitem>
				If the HTTP request does contain session information, meaning that either a cookie, query parameter, or header with the name of <code>metreosSessionId</code> has the <link linkend=""ApiGlossary.RoutingGuid"">RoutingGuid</link> of a script as its value, then the event is sent to the <code>Application Runtime Environment</code>  as a <code>non-triggering event</code>.  The event is routed to a script with a RoutingGuid matching that found in the session information from the request, at which point: 
				<itemizedlist>
					<listitem>
						If the <code>event signature</code> of the request matches the <code>event filter criteria</code> of one of the HTTP event handler functions defined in that routed-to script, that event will be placed into the <link linkend=""ApiGlossary.ScriptEventQueue""><code>script event queue</code></link> of that script to be handled so that it will be processed by the script--or if there are no functions currently being processed in the script then the event will be processed immediately.
					</listitem>
					<listitem>
						Otherwise if no event handler function defined matches the event signature within the routed-to script or if the script with the specified <code>RoutingGuid</code> has already ended, the <code>GotRequest</code> is not handled, and the HTTP provider will then resend the same <code>GotRequest</code> event as a triggering event (essentially the same event as before but without the RoutingGuid included).  All the behavior and rules of an HTTP <code>GotRequest</code> triggering event, defined in step 1 above then apply.
					</listitem>
				</itemizedlist>
			</listitem>
		</orderedlist>
	    </para>
	    <para>
	    	The type <link linkend=""Metreos.Types.Http.QueryParamCollection""><code>QueryParamCollection</code></link> can be used to easily access query parameters associated with the incoming HTTP request.
	    </para>
	    <para>
	    	The <code>GotRequest</code> has all headers supplied as custom event parameters. To access these headers, one must create a local variable in the designer and initialize the variable, supplying the name of the header of interest as the value of the <link linkend=""ApiGlossary.LocalInitializeWith""><code>InitializeWith</code></link> property.  Be sure to also specify the <link linkend=""ApiGlossary.LocalDefaultValue""><code>DefaultValue</code></link> property so that the script starts gracefully in the case that the header is not present in the request.  One can also use the value of the default value parameter to determine if the header is present or not in the request--by comparing the value of the local variable to the value of the default value, one can determine if it was initialized with the header value or the default value.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
            <para>
               The HTTP Provider listens on port <code>8000</code> for script-bound HTTP requests.  This port is not configurable.
            </para>
	    <para>
	    	The HTTP Provider does not support HTTPS.
	    </para>
	    <para>
	    	If one does not send a response with their script within <code>5</code> minutes, the HTTP provider will automatically send a <code>404</code> back to the client.
	    </para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "GotRequest";
                public const string FULLNAME = Globals.NAMESPACE + "." + "GotRequest";
                public class Params
                {
                    public class body
                    {
                        public const string NAME = "body";
                        public const string DISPLAY = "Body";
                        public const string DESCRIPTION =
@"The content of the request.  If the <code>Method</code> is a POST, then one can initialize a <link linkend=""Metreos.Types.Http.FormCollection""><code>FormCollection</code></link> with this event parameter, in order to access the useful utilities found in the <code>FormCollection</code> type.";
                    }
                    public class hostname
                    {
                        public const string NAME = "hostname";
                        public const string DISPLAY = "Hostname";
                        public const string DESCRIPTION = 
@"The host portion of the request URI.  Port information is not contained within this parameter.";
                    }
                    public class url
                    {
                        public const string NAME = "url";
                        public const string DISPLAY = "Url";
                        public const string DESCRIPTION = 
@"The path portion of the request URI, always starting with the initial '/' after the <code>Host</code> portion parameter of the URI, and ending with the last character in the URI or, if '?' is present in the URI, the character before the first occurrence of '?'.";
