            public class SessionExpired
            {
                public const string NAME = "SessionExpired";
                public const string DESCRIPTION =
@"<variablelist>
    <varlistentry>
        <term>Summary</term>
        <listitem>
            <para>
                <code>SessionExpired</code> is sent to any scripts that have been deemed inactive. 
            </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Usage</term>
        <listitem> 
            <para>
                The <code>SessionExpired</code> is sent to a script if the following criteria is satisfied:
		<itemizedlist>
			<listitem>
	       			The script was initiated by the HTTP Provider <link linkend=""Metreos.Providers.Http.GotRequest""><code>GotRequest</code></link>.
			</listitem>
			<listitem>
				The script has received no subsequent <link linkend=""ApiGlossary.NonTriggeringEvent""><code>non-triggering</code></link> <code>GotRequest</code> events for an amount of time equal to or greater than the cleanup period of the HTTP provider, which is by default <code>20</code> minutes.
			</listitem>
			<listitem>
				The script has not executed the <link linkend=""Metreos.Providers.Http.SessionEnd""><code>SessionEnd</code></link> action.
			</listitem>
			<listitem>
				The HTTP provider has never received a <link linkend=""ApiGlossary.NoHandler"">no handler</link> in response to sending a <code>SessionExpired</code> event.  The HTTP Provider uses the occurrence of a no handler to indicate that the script is no longer running, or that it does not define an event handler for <code>SessionExpired</code>.  In either case, this means to the HTTP provider that the script instance does not need to be informed of a session expired event and that it will no longer attempt to send the <code>SessionExpired</code> event to that script instance.
			</listitem>
		</itemizedlist>
            </para>
	    <para>
	    	Upon receiving the <code>SessionExpired</code> event, what should be done is entirely up to the developer; the application server places no expectations or requirements on the script instance.  Specifically, it is not required that the script instance come to an end when <link linkend=""Metreos.Providers.Http.SessionExpired""><code>SessionExpired</code></link> occurs; however, it is reasonable to expect that a large percentage of scripts will indeed end with the occurrence of this event, since it indicates inactivity of over 20 minutes.  Couple this amount of inactivity with the session-less nature of HTTP and the inherent difficulty of tracking the state of the user of the application, one can see why most scripts would end when this event occurs.  If the developer chooses to not end the script upon receiving the <code>SessionExpired</code> event, then <code>SessionExpired</code> events will continue to fire for that script until one of the conditions is met in the above list. 
	    </para>
	    <para>
	    	If you end a script at any point, one can use the <link linkend=""Metreos.Providers.Http.SessionEnd""><code>SessionEnd</code></link> action to indicate to the HTTP Provider that it can release the session from it's memory.  In other words, it no longer will track this script instance any longer.
	    </para>
        </listitem>
    </varlistentry>
    <varlistentry>
        <term>Remarks</term>
        <listitem>
        	<para>
			None.
		</para>
        </listitem>
    </varlistentry>
</variablelist>";
                public const string DISPLAY = "SessionExpired";
                public const string FULLNAME = Globals.NAMESPACE + "." + "SessionExpired";
            }
        }
    }
